    t[234] = "Note: Your contribution to the network (network share) is determined by the allocation of upstream bandwidth (upload speed).";
    t[235] = "Remarque : votre contribution au r\u00e9seau (part de r\u00e9seau) est d\u00e9termin\u00e9e par l'allocation de la bande passante en amont (vitesse de t\u00e9l\u00e9chargement).";
    t[236] = "Advanced Router Configuration";
    t[237] = "Configuration Avanc\u00e9e du Routeur";
    t[238] = "Allocate number of processor threads for building tunnels. If your processor supports hyperthreading or simultaneous multithreading, you may multiply the number of processor cores by 2 to get the maximum number of threads to allocate, otherwise number of processor cores = maximum number of threads available. Note that you may wish to allocate less than the theoretical maximum to ensure you have headroom for other tasks.";
    t[239] = "Allouer le nombre de threads de processeur pour la construction de tunnels. Si votre processeur prend en charge l'hyperthreading ou le multithreading simultan\u00e9, vous pouvez multiplier le nombre de c\u0153urs de processeur par 2 pour obtenir le nombre maximal de threads \u00e0 allouer, sinon le nombre de c\u0153urs de processeur = le nombre maximal de threads disponibles. Notez que vous souhaiterez peut-\u00eatre allouer moins que le maximum th\u00e9orique pour vous assurer d'avoir une marge de man\u0153uvre pour d'autres t\u00e2ches.";
