    t[286] = "Note that there can only be a single reference to the <i class=example>default</i> keyword in a filter file. If unstated, all connections are permitted unless explicitly forbidden. Errors in the filter file will prevent a stopped tunnel from starting, so be sure to double check the syntax before deployment.";
    t[287] = "Notez qu'il ne peut y avoir qu'une seule r\u00e9f\u00e9rence au mot-cl\u00e9 <i class=example>default</i> dans un fichier filtre. Si non sp\u00e9cifi\u00e9, toutes les connexions sont autoris\u00e9es sauf interdiction explicite. Les erreurs dans le fichier filtre emp\u00eacheront un tunnel arr\u00eat\u00e9 de d\u00e9marrer, veillez donc \u00e0 v\u00e9rifier la syntaxe deux fois avant le d\u00e9ploiement.";
