    t[364] = "When a new service tunnel is created, or a service is run for the first time (e.g. the default jetty webserver, plugins), a private encryption key is created which essentially controls the ownership of address. This is usually named <code>&hellip;privKey.dat</code>, or <code>eepPriv.dat</code>, though it's a good idea to change the name to indicate the service it belongs to and then respecify it in the Tunnel Manager server settings. This .dat file should be backed up safely; lose it and you will lose ownership and control of your hostname!";
    t[365] = "Lorsqu'un nouveau tunnel de service est cr\u00e9\u00e9 ou qu'un service est ex\u00e9cut\u00e9 pour la premi\u00e8re fois (par exemple le serveur web jetty par d\u00e9faut, les plugins), une cl\u00e9 de chiffrement priv\u00e9e est cr\u00e9\u00e9e qui contr\u00f4le essentiellement la propri\u00e9t\u00e9 de l'adresse. Elle porte habituellement le nom de <code>&hellip;privKey.dat</code> ou <code>eepPriv.dat</code>, bien qu'il soit pr\u00e9f\u00e9rable de modifier le nom pour indiquer le service auquel il appartient puis de le respecifier dans les param\u00e8tres du serveur du Tunnel Manager. Ce fichier .dat doit \u00eatre sauvegard\u00e9 de mani\u00e8re s\u00e9curis\u00e9e ; si vous le perdez, vous perdrez la propri\u00e9t\u00e9 et le contr\u00f4le de votre nom d'h\u00f4te !";
    t[368] = "This setting allows configuration of the maximum number of files per torrent I2PSnark will permit, when downloading or creating a torrent. Note that substantially increasing this value from the default of 2000 files may require additional configuration on the host system to increase the maximum number of open files the operating system will permit (e.g. <code>ulimit -n</code> on Linux). To change, add to I2PSnark's configuration file <code>i2psnark.config</code>. [Restart of I2PSnark or router required]";
    t[369] = "Ce param\u00e8tre permet de configurer le nombre maximal de fichiers par torrent qu'I2PSnark autorisera, lors du t\u00e9l\u00e9chargement ou de la cr\u00e9ation d'un torrent. Notez qu'augmenter substantiellement cette valeur par rapport \u00e0 la valeur par d\u00e9faut de 2000 fichiers peut n\u00e9cessiter une configuration suppl\u00e9mentaire sur le syst\u00e8me h\u00f4te pour augmenter le nombre maximal de fichiers ouverts que le syst\u00e8me d'exploitation autorisera (par ex. <code>ulimit -n</code> sur Linux). Pour modifier, ajouter au fichier de configuration d'I2PSnark <code>i2psnark.config</code>. [Red\u00e9marrage d'I2PSnark ou du routeur requis]";
    t[370] = "Configure router bandwidth allocation";
