    t[372] = "Here are some other public addressbook subscription links. You may wish to add one or two to your <a href='/dns?subscriptions' target=_blank rel=noreferrer>susidns subscription list</a>. In the event that addresses conflict in the subscriptions, the lists placed at the top of your susidns configuration will take precedence over those placed further down.";
    t[373] = "Voici quelques autres liens d'abonnement publics au carnet d'adresses. Vous voudrez peut-\u00eatre en ajouter un ou deux \u00e0 votre <a href='/dns?subscriptions' target=_blank rel=noreferrer>liste d'abonnements susidns</a>. Dans le cas o\u00f9 des adresses sont en conflit dans les abonnements, les listes plac\u00e9es en haut de votre configuration susidns primeront sur celles plac\u00e9es plus bas.";
