    t[554] = "Choose a name for your website (<i>hostname</i>.i2p), using lower-case. To verify that the hostname is available, check <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> or <a href=http://reg.i2p target=_blank>reg.i2p</a> before you decide. Enter the new name for your website on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a> where it says <i>Website name</i>, replacing the default <i>mysite.i2p</i> placeholder. If you want your website to be available when I2P starts, enable <i>Auto Start</i> and then click <i>Save</i>.";
    t[555] = "Choisissez un nom pour votre site web (<i>hostname</i>.i2p) en minuscules. Pour v\u00e9rifier que le nom de domaine est disponible, v\u00e9rifiez sur <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> ou <a href=http://reg.i2p target=_blank>reg.i2p</a> avant de vous d\u00e9cider. Indiquez le nouveau nom de votre site web sur la page de configuration du <a href='/i2ptunnel/edit?tunnel=3'>Gestionnaire de tunnels</a> o\u00f9 il est indiqu\u00e9 <i>Nom de site</i>, en rempla\u00e7ant le nom factice par d\u00e9faut <i>mysite.i2p</i>. Si vous souhaitez que votre site soit disponible au d\u00e9marrage d'I2P, activez <i>D\u00e9marrage automatique</i> puis cliquez sur <i>Enregistrer</i>.";
    t[556] = "When set to true, this enables gzip compression for the router console and default web applications. [Enabled by default]";
