    t[616] = "Bonuses may be positive or negative, and affect the peer's inclusion in Fast and High Capacity tiers. Fast peers are used for client tunnels, and High Capacity peers are used for some exploratory tunnels.";
    t[617] = "Les bonus peuvent \u00eatre positifs ou n\u00e9gatifs et affecter l'inclusion du pair dans des niveaux de capacit\u00e9 rapide et \u00e9lev\u00e9e. Des pairs rapides sont utilis\u00e9s pour les tunnels clients et les pairs de grande capacit\u00e9 sont utilis\u00e9s pour certains tunnels exploratoires.";
    t[618] = "Yes";
    t[619] = "Oui";
    t[620] = "While I2P will work fine in this configuration, if you really have over 128KBps of bandwidth to share, it will be much more helpful to the network if you open your firewall.";
    t[621] = "Bien qu\u2019I2P fonctionnera correctement avec cette configuration, si vous avez vraiment plus de 128 ko/s de bande passante \u00e0 partager, il serait bien plus b\u00e9n\u00e9fique pour le r\u00e9seau que vous ouvriez votre pare-feu.";
    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "Une application en ligne de commande fournie avec I2P qui est utilis\u00e9e pour demander des ressources URL, de fa\u00e7on similaire \u00e0 <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> ou <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget est \u00e9galement utilis\u00e9 en interne par le routeur, par exemple pour effectuer une r\u00e9ensemence \u00e0 partir d'h\u00f4tes distants. Par d\u00e9faut, eepget utilise le proxy HTTP sur <code>127.0.0.1:4444</code>.";
