    t[722] = "Javadocs";
    t[723] = "Javadocs";
    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "Un site eep est un site web h\u00e9berg\u00e9 de mani\u00e8re anonyme sur le r\u00e9seau I2P - vous pouvez y acc\u00e9der en configurant votre navigateur web pour utiliser le proxy HTTP d'I2P (voir ci-dessus) et en naviguant vers le site dont l'adresse se termine par <code>.i2p</code> (par exemple <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Assurez-vous \u00e9galement que votre navigateur est configur\u00e9 pour r\u00e9soudre le DNS de mani\u00e8re distante lors de l'utilisation du proxy afin d'\u00e9viter les fuites DNS.";
    t[730] = "Updating UDP port to {0}";
