    t[733] = "Guide de s\u00e9curit\u00e9 du serveur Web Apache";
    t[736] = "Locate the configuration file: <code>00-net.i2p.router.web.RouterConsoleRunner-clients.config</code> in the <code>clients.config.d</code> folder in your I2P settings directory, and then edit accordingly:";
    t[737] = "Localisez le fichier de configuration : <code>00-net.i2p.router.web.RouterConsoleRunner-clients.config</code> dans le dossier <code>clients.config.d</code> dans le r\u00e9pertoire de configuration I2P, puis modifiez-le en cons\u00e9quence:";
