    t[772] = "If you can't, I2P supports UPnP (Universal Plug and Play) and UDP hole punching with \"SSU introductions\" to relay traffic.";
    t[773] = "Si vous ne le pouvez pas, I2P prend en charge l\u2019UPnP (pr\u00eat-\u00e0-l\u2019emploi universel) et le per\u00e7age de trou UDP avec \u00ab\u00a0pr\u00e9sentations SSU\u00a0\u00bb pour relayer le trafic.";
