    t[836] = "The first number is the number of peers your router has sent or received a message from in the last few minutes. This may range from 8-10 to several hundred, depending on your total bandwidth, shared bandwidth, and locally-generated traffic. The second number is the number of peers seen in the last hour or so. Do not be concerned if these numbers vary widely. <a href='/configstats#router.activePeers'>[Enable graphing]</a>.";
    t[837] = "Le premier nombre est le nombre de pairs avec lesquels votre routeur a envoy\u00e9 ou re\u00e7u un message au cours des derni\u00e8res minutes. Cela peut varier de 8-10 \u00e0 plusieurs centaines, selon votre bande passante totale, votre bande passante partag\u00e9e et le trafic g\u00e9n\u00e9r\u00e9 localement. Le second nombre est le nombre de pairs vu au cours de la derni\u00e8re heure environ. Ne vous inqui\u00e9tez pas si ces nombres varient grandement. <a href='/configstats#router.activePeers'>[Activer le graphique]</a>";
    t[838] = "This file should be used only for a very limited number of friends (less than 3).";
