    t[878] = "This setting permits disabling SSU tests to determine if your router is firewalled and can be enabled for routers that are definitely not firewalled but are experiencing intermittent firewalling issues. In the event that testing is disabled, both SSU and NTCP should report your current public ip address on <a href=/info>the router info page</a>. [Restart required]";
    t[879] = "Ce param\u00e8tre permet de d\u00e9sactiver les tests SSU pour d\u00e9terminer si votre routeur est derri\u00e8re un pare-feu et peut \u00eatre activ\u00e9 pour les routeurs qui ne sont d\u00e9finitivement pas derri\u00e8re un pare-feu mais rencontrent des probl\u00e8mes de pare-feu intermittents. Dans le cas o\u00f9 les tests sont d\u00e9sactiv\u00e9s, le SSU et le NTCP devraient afficher votre adresse IP publique actuelle sur la <a href=/info>page d'informations du routeur</a>. [Red\u00e9marrage requis]";
