    t[980] = "Your webserver is running by default at <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, but is not accessible by others until you start the <i>I2P Webserver</i> tunnel. After starting the tunnel, your site will be difficult for other people to find. You could just tell people the destination or the Base32 address, but thankfully I2P has an address book to store domain names, and various services where you can <a href=/help/hostnameregistration>register a new .i2p domain</a> for free.";
    t[981] = "Votre serveur web fonctionne par d\u00e9faut sur <a href=http://127.0.0.1:7658/>http://127.0.0.1:7658</a>, mais n'est accessible par les autres que lorsque vous d\u00e9marrez le tunnel <i>Serveur web I2P</i>. Apr\u00e8s le d\u00e9marrage du tunnel, votre site sera difficile \u00e0 trouver pour les autres personnes. Vous pourriez simplement leur communiquer la destination ou l'adresse Base32, mais heureusement I2P dispose d'un carnet d'adresses pour stocker les noms de domaine, et divers services o\u00f9 vous pouvez <a href=/help/hostnameregistration>enregistrer gratuitement un nouveau domaine .i2p</a>.";
    t[984] = "Major Sybil Warning - above router is closer than average minimum distance";
