    t[1061] = "Aide \u00e0 l'interface utilisateur";
    t[1062] = "When set to true, accessing the router console via http:// when https:// is enabled will automatically redirect to https. To configure router console access, edit the settings in your <code>clients.config</code> file in your profile directory (<i>not</i> the application installation directory). [Enabled by default]";
