    t[1174] = "Unless an outproxy has been set up for the service you want to connect to, this is not possible, with the exception of BitTorrent (see below). There are only three types of outproxies running right now: HTTP, HTTPS, and email. Note that there is currently no publicly listed SOCKS outproxy. If this type of service is required, try <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
    t[1175] = "\u00c0 moins qu'un outproxy n'ait \u00e9t\u00e9 configur\u00e9 pour le service auquel vous souhaitez vous connecter, cela n'est pas possible, \u00e0 l'exception de BitTorrent (voir ci-dessous). Il n'y a actuellement que trois types d'outproxies fonctionnels : HTTP, HTTPS et courrier \u00e9lectronique. Notez qu'il n'y a actuellement aucun outproxy SOCKS r\u00e9pertori\u00e9 publiquement. Si ce type de service est n\u00e9cessaire, essayez <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
