    t[1209] = "Regarder la grande technologie...";
    t[1212] = "The skew (offset) of your computer's clock relative to the network-synced time (if known). I2P requires your computer's time be accurate. If the skew is more than a few seconds, please correct the problem by adjusting your computer's time. If I2P cannot connect to the internet, a reading of 0ms may be indicated. Note: This is only displayed in the <i>Router Information (advanced)</i> section. You may add this section to your Sidebar on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[1213] = "Le d\u00e9calage (offset) de l'horloge de votre ordinateur par rapport \u00e0 l'heure synchronis\u00e9e du r\u00e9seau (si connue). I2P n\u00e9cessite que l'horloge de votre ordinateur soit pr\u00e9cise. Si le d\u00e9calage est sup\u00e9rieur \u00e0 quelques secondes, veuillez corriger le probl\u00e8me en ajustant l'horloge de votre ordinateur. Si I2P ne peut pas se connecter \u00e0 Internet, un d\u00e9calage de 0 ms peut \u00eatre indiqu\u00e9. Note : Ceci n'est affich\u00e9 que dans la section <i>Informations routeur (avanc\u00e9)</i>. Vous pouvez ajouter cette section \u00e0 votre barre lat\u00e9rale sur la page de <a href='/configsidebar'>configuration de la barre lat\u00e9rale</a>.";
