    t[1272] = "To migrate the key to a new router, or to setup multihoming (running the same service on multiple routers for redundancy and load-balancing), copy the backed up key to your .i2p directory and specify it in the new server tunnel, or replace the default key in the plugin folder (e.g. the zzzot plugin).";
    t[1273] = "Pour migrer la cl\u00e9 vers un nouveau routeur, ou pour configurer le multihoming (ex\u00e9cuter le m\u00eame service sur plusieurs routeurs pour la redondance et l'\u00e9quilibrage de charge), copiez la cl\u00e9 sauvegard\u00e9e dans votre r\u00e9pertoire .i2p et sp\u00e9cifiez-la dans le nouveau tunnel serveur, ou remplacez la cl\u00e9 par d\u00e9faut dans le dossier du plugin (par exemple le plugin zzzot).";
