    t[1462] = "How long an outbound message waits in the queue. This should generally be a few hundred milliseconds or less. If it is consistently higher than 1000ms, your computer is very slow, or you should adjust your bandwidth limits, or your (BitTorrent?) clients may be sending too much data and should have their transmit bandwidth limit reduced. <a href='/configstats#transport.sendProcessingTime'>[Enable graphing]</a> (transport.sendProcessingTime).";
    t[1463] = "Temps d'attente d'un message sortant dans la file d'attente. Il devrait g\u00e9n\u00e9ralement \u00eatre de quelques centaines de millisecondes au maximum. S'il est constamment sup\u00e9rieur \u00e0 1000 ms, votre ordinateur est tr\u00e8s lent, ou vous devriez ajuster vos limites de bande passante, ou vos clients (BitTorrent ?) peuvent envoyer trop de donn\u00e9es et leur limite de bande passante d'\u00e9mission devrait \u00eatre r\u00e9duite. <a href='/configstats#transport.sendProcessingTime'>[Activer le graphique]</a> (transport.sendProcessingTime).";
