    t[1574] = "The core I2P software, which routes encrypted packets on the I2P network. All routers by default participate in the network except routers running in countries considered hostile (see <i>Strict Countries</i>), which both helps the network and provides cover traffic for any clients or servers connecting to the I2P network through the router.";
    t[1575] = "Le logiciel I2P de base, qui route les paquets chiffr\u00e9s sur le r\u00e9seau I2P. Tous les routeurs participent par d\u00e9faut au r\u00e9seau, \u00e0 l'exception des routeurs fonctionnant dans des pays consid\u00e9r\u00e9s comme hostiles (voir <i>Pays stricts</i>), ce qui aide \u00e0 la fois le r\u00e9seau et fournit un trafic de couverture pour tous les clients ou serveurs se connectant au r\u00e9seau I2P via le routeur.";
