    t[2188] = "The following threshold definition <i class=example>180/60</i> specifies that the same remote destination is allowed to make 179 connection attempts during a 60 second period. If it makes one more attempt within the same period, the threshold will be breached and further connection attempts will be rejected until the end of the period:";
    t[2189] = "La d\u00e9finition de seuil suivante <i class=example>180/60</i> sp\u00e9cifie qu'une m\u00eame destination distante est autoris\u00e9e \u00e0 effectuer 179 tentatives de connexion sur une p\u00e9riode de 60 secondes. Si elle en fait une de plus sur la m\u00eame p\u00e9riode, le seuil sera viol\u00e9 et les tentatives de connexion ult\u00e9rieures seront rejet\u00e9es jusqu'\u00e0 la fin de la p\u00e9riode:";
