    t[2210] = "I2P selects a random port between 9000 and 31000 to communicate with other routers when the program is run for the first time, or when your external IP address changes when running in <a href=/confignet#ipchange>Laptop Mode</a>. The <a href=/confignet#udpconfig>selected port</a> is shown on the <a href=/confignet>Network Configuration page</a>.";
    t[2211] = "I2P s\u00e9lectionne un port al\u00e9atoire entre 9000 et 31000 pour communiquer avec d'autres routeurs lors du premier lancement du programme, ou lorsque votre adresse IP externe change en ex\u00e9cutant le <a href=/confignet#ipchange>mode portable</a>. Le <a href=/confignet#udpconfig>port s\u00e9lectionn\u00e9</a> est affich\u00e9 sur la <a href=/confignet>page de configuration r\u00e9seau</a>.";
    t[2212] = "Message send rate (B/s)";
