    t[2232] = "It will take at least 10 minutes from your router starting for it to accept building participating tunnels in order to ensure your router is stable and successfully bootstrapped to the network.";
    t[2233] = "Il faudra au moins 10 minutes apr\u00e8s le d\u00e9marrage de votre routeur pour qu'il accepte de construire des tunnels de participation afin de s'assurer que votre routeur est stable et correctement int\u00e9gr\u00e9 au r\u00e9seau par bootstrap.";
