    t[2246] = "A gentle introduction to I2P";
    t[2247] = "Une introduction douce \u00e0 I2P";
    t[2250] = "How long jobs are waiting before execution. The job queue is listed on the <a href='/jobs'>Jobs page</a>. Unfortunately, there are several other job queues in the router that may be congested, and their status is not available in the router console. The job lag should generally be zero. If it is consistently higher than 500ms, your computer is very slow, your network is experiencing connectivity issues, or the router has serious problems. <a href='/configstats#jobQueue.jobLag'>[Enable graphing]</a>.";
    t[2251] = "Temps d'attente des t\u00e2ches avant leur ex\u00e9cution. La file d'attente des t\u00e2ches est r\u00e9pertori\u00e9e sur la page <a href='/jobs'>Jobs</a>. Malheureusement, il existe plusieurs autres files d'attente de t\u00e2ches dans le routeur qui peuvent \u00eatre congestionn\u00e9es, et leur \u00e9tat n'est pas disponible dans la console du routeur. Le d\u00e9lai des t\u00e2ches devrait g\u00e9n\u00e9ralement \u00eatre nul. S'il est r\u00e9guli\u00e8rement sup\u00e9rieur \u00e0 500 ms, votre ordinateur est tr\u00e8s lent, votre r\u00e9seau conna\u00eet des probl\u00e8mes de connectivit\u00e9 ou le routeur pr\u00e9sente de graves dysfonctionnements. <a href='/configstats#jobQueue.jobLag'>[Activer le graphique]</a>";
    t[2252] = "Configure I2P Updates";
    t[2253] = "Configurer les mises \u00e0 jour d\u2019I2P";
    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "Avant de parler de votre nouveau site web, vous devriez y ajouter du contenu. Rendez-vous dans le r\u00e9pertoire racine du serveur <a href=#rootdir>indiqu\u00e9 ci-dessus</a> et remplacez la page de redirection <i>index.html</i> par votre propre contenu. Si vous avez besoin d'un mod\u00e8le pour un site basique, n'h\u00e9sitez pas \u00e0 adapter <a href=http://127.0.0.1:7658/help/pagetemplate.html>cette page</a>. Si vous \u00eates redirig\u00e9 vers cette page apr\u00e8s avoir modifi\u00e9 le contenu, essayez de vider le cache de votre navigateur.";
