    t[2312] = "If your router has 10 or more active peers, everything is fine. The router should maintain connections to a few peers at all times. The best way to stay \"better-connected\" to the network is to <a href=/config>share more bandwidth</a>.";
    t[2313] = "Si votre routeur a 10 pairs actifs ou plus, tout va bien. Le routeur devrait maintenir des connexions \u00e0 quelques pairs en permanence. La meilleure fa\u00e7on de rester \"mieux connect\u00e9\" au r\u00e9seau est de <a href=/config>partager plus de bande passante</a>.";
