    t[2371] = "Glossaire";
    t[2376] = "To obtain your own hostname, I2P domain registrars such as <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> or <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> provide registration services that allow you to register and manage an .i2p hostname or sub-domain which will then be propagated across the network. Some registration sites will require the <i>B64 destination address</i> for the tunnel/service you wish to associate with a hostname, which you should copy from the <i>Local destination</i> section on the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[2377] = "Pour obtenir votre propre nom de domaine, des registres I2P tels que <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> ou <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> proposent des services d'enregistrement qui vous permettent d'enregistrer et de g\u00e9rer un nom de domaine ou sous-domaine .i2p, qui sera ensuite propag\u00e9 sur tout le r\u00e9seau. Certains sites d'enregistrement peuvent exiger l'<i>adresse de destination B64</i> du tunnel/service que vous souhaitez associer \u00e0 un nom de domaine, que vous devez copier de la section <i>Destination locale</i> sur la page de configuration du <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Gestionnaire de tunnels</a>.";
