    t[2471] = "Contr\u00f4le manuel des pairs";
    t[2482] = "This indicates the amount of RAM I2P is using, and the total amount available, allocated by Java. If the usage is consistently high relative to the available RAM, this may indicate that you need to increase the ram allocated to the JVM. You can allocate more RAM by editing your <code>wrapper.config</code> file which is normally located in the I2P application directory. You will need to edit the <code>wrapper.java.maxmemory</code> parameter, which by default is set to 256(MB) for I2P, or 384 for I2P+. Note: if the memory bar is enabled, the memory entry in the router info section will be suppressed.";
    t[2483] = "Ceci indique la quantit\u00e9 de RAM utilis\u00e9e par I2P et la quantit\u00e9 totale disponible, allou\u00e9e par Java. Si l'utilisation est r\u00e9guli\u00e8rement \u00e9lev\u00e9e par rapport \u00e0 la RAM disponible, cela peut indiquer que vous devez augmenter la RAM allou\u00e9e \u00e0 la JVM. Vous pouvez allouer plus de RAM en modifiant votre fichier <code>wrapper.config</code> qui se trouve normalement dans le r\u00e9pertoire d'application I2P. Vous devrez modifier le param\u00e8tre <code>wrapper.java.maxmemory</code>, qui est par d\u00e9faut d\u00e9fini \u00e0 256 (MB) pour I2P, ou 384 pour I2P+. Remarque&nbsp: si la barre de m\u00e9moire est activ\u00e9e, l'entr\u00e9e de m\u00e9moire dans la section informations routeur sera supprim\u00e9e.";
