    t[2531] = "Entrant/Sortant";
    t[2536] = "Under <i>Configure Proxy Access to Internet</i> select the <i>Manual proxy configuration</i> option.";
    t[2537] = "Sous <i>Configurer l'acc\u00e8s proxy \u00e0 Internet</i>, s\u00e9lectionnez l'option <i>Configuration manuelle du proxy</i>.";
    t[2538] = "To serve your own static content, you only need to edit or replace the files in the webserver's root directory, and the site will be available on the I2P network after you've followed the instructions below. Additionally, cgi and python scripts can be run from the <code>cgi-bin</code> directory immediately above <code>docroot</code> if you have <a href=https://www.perl.org/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> and <a href=https://www.python.org/ target=_blank rel=noreferrer class='sitelink external'>python</a> installed.";
    t[2539] = "Pour servir votre propre contenu statique, il vous suffit de modifier ou de remplacer les fichiers dans le r\u00e9pertoire racine du serveur web, et le site sera disponible sur le r\u00e9seau I2P apr\u00e8s avoir suivi les instructions ci-dessous. De plus, les scripts cgi et python peuvent \u00eatre ex\u00e9cut\u00e9s \u00e0 partir du r\u00e9pertoire <code>cgi-bin</code> situ\u00e9 juste au-dessus de <code>docroot</code> si vous avez install\u00e9 <a href=https://www.perl.org/fr/about.html target=_blank rel=noreferrer class='sitelink external'>perl</a> et <a href=https://www.python.org/fr/ target=_blank rel=noreferrer class='sitelink external'>python</a>.";
