    t[2578] = "Many of the stats on the sidebar may be <a href='/configstats'>configured</a> to be <a href='/graphs'>graphed</a> for further analysis. You may also customize the sections that appear on the Sidebar and their positioning on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[2579] = "De nombreuses statistiques dans la barre lat\u00e9rale peuvent \u00eatre <a href='/configstats'>configur\u00e9es</a> pour \u00eatre <a href='/graphs'>graphiques</a> \u00e0 des fins d'analyse plus pouss\u00e9e. Vous pouvez \u00e9galement personnaliser les sections apparaissant dans la barre lat\u00e9rale et leur positionnement sur la page de <a href='/configsidebar'>configuration de la barre lat\u00e9rale</a>.";
    t[2582] = "This tunnel-specific setting allows you to enable or disable replies to pings sent to servers hosted by the router. To disable pings, you must add the line <code>i2p.streaming.answerPings=false</code> to the <i>Custom Options</i> section for the server's configuration in the Tunnel Manager.";
    t[2583] = "Ce param\u00e8tre sp\u00e9cifique au tunnel vous permet d'activer ou de d\u00e9sactiver les r\u00e9ponses aux pings envoy\u00e9s aux serveurs h\u00e9berg\u00e9s par le routeur. Pour d\u00e9sactiver les pings, vous devez ajouter la ligne <code>i2p.streaming.answerPings=false</code> dans la section <i>Options personnalis\u00e9es</i> de la configuration du serveur dans le Gestionnaire de tunnels.";
    t[2592] = "Max";
    t[2593] = "Max.";
    t[2598] = "If you wish to install unsigned (.zip) I2P updates, this should be added to your <code>router.config</code> file unless you have already configured <code>routerconsole.advanced=true</code>, in which case this option is already provisioned. Note: as of I2P+ 0.9.48+, installation of <a href=/configupdate#i2pupdates>unsigned updates</a> is enabled by default.";
    t[2599] = "Si vous souhaitez installer des mises \u00e0 jour I2P non sign\u00e9es (.zip), cette option devrait \u00eatre ajout\u00e9e \u00e0 votre fichier <code>router.config</code> \u00e0 moins que vous ayez d\u00e9j\u00e0 configur\u00e9 <code>routerconsole.advanced=true</code>, auquel cas cette option est d\u00e9j\u00e0 prise en charge. Remarque : \u00e0 partir d'I2P+ 0.9.48+, l'installation de <a href=/configupdate#i2pupdates>mises \u00e0 jour non sign\u00e9es</a> est activ\u00e9e par d\u00e9faut.";
