    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "Ce param\u00e8tre (en secondes) vous permet de substituer le d\u00e9lai entre les ex\u00e9cutions de la t\u00e2che d'Exploration de pairs qui tente de localiser de nouveaux pairs \u00e0 ajouter \u00e0 la NetDb. La t\u00e2che s'ex\u00e9cute toutes les 80 secondes par d\u00e9faut, ou si le routeur conna\u00eet un retard de t\u00e2che ou de messages, toutes les 3 minutes. Si la taille de la NetDb atteint 4000 pairs, la pause augmentera \u00e0 15 minutes. Vous voudrez peut-\u00eatre augmenter le d\u00e9lai si votre NetDb contient d\u00e9j\u00e0 beaucoup de pairs (plus de 2000), ou si vous souhaitez r\u00e9duire l'utilisation globale de la bande passante. Remarque : pour les routeurs de type floodfill, cette t\u00e2che ne s'ex\u00e9cute pas.";
    t[2698] = "Current";
    t[2699] = "Courant";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "Un site Web h\u00e9berg\u00e9 sur le r\u00e9seau I2P. Par d\u00e9faut, un <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>serveur web Jetty</a> est configur\u00e9 et fonctionne sur <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "Peut \u00eatre d\u00e9sactiv\u00e9 ou modifi\u00e9 dans le <a href=/i2ptunnelmgr>Gestionnaire de tunnels</a>. Peut \u00e9galement \u00eatre configur\u00e9 pour se lier \u00e0 une interface sp\u00e9cifique ou \u00e0 toutes les interfaces.";
    t[2728] = "I2P+ Service now enabled on system start";
    t[2729] = "Le service I2P est d\u00e9sormais activ\u00e9 au d\u00e9marrage du syst\u00e8me";
    t[2748] = "Computer related news aggregation";
    t[2749] = "Agr\u00e9gation de nouvelles li\u00e9es \u00e0 l'informatique";
    t[2752] = "Same IP as us";
    t[2753] = "M\u00eame IP que nous";
    t[2754] = "You may create a new router family here. Once you have created the family, you may export the family key file and share with other routers in your nominated family.";
    t[2755] = "Vous pouvez cr\u00e9er une nouvelle famille de routeurs ici. Une fois que vous avez cr\u00e9\u00e9 la famille, vous pouvez exporter le fichier cl\u00e9 de la famille et partager avec d'autres routeurs de votre famille d\u00e9sign\u00e9e.";
    t[2756] = "Tunnels peer has agreed to participate in";
    t[2757] = "Tunnels peer a accept\u00e9 de participer \u00e0";
    t[2758] = "Advanced Lookup";
    t[2759] = "Recherche avanc\u00e9e";
    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "Afin d'acc\u00e9der aux sites web h\u00e9berg\u00e9s sur I2P, et facultativement d'utiliser l'outproxy par d\u00e9faut pour se connecter \u00e0 des sites web sur internet clair, vous devrez configurer votre navigateur pour utiliser le proxy HTTP I2P, fonctionnant par d\u00e9faut sur <code>127.0.0.1 port 4444</code>. La plupart des navigateurs proposent une option pour configurer votre proxy; dans ce mini-tutoriel, nous nous concentrerons sur Firefox.";
    t[2776] = "Close to us";
    t[2777] = "Proche de nous";
    t[2790] = "I2P+ Router Sitemap";
    t[2791] = "Plan du site du routeur I2P";
    t[2794] = "Downloaded plugin version {0} is not newer than installed plugin";
    t[2795] = "La version {0} du greffon t\u00e9l\u00e9charg\u00e9 n\u2019est pas plus r\u00e9cente que celle install\u00e9e";
    t[2796] = "Streaming radio service";
    t[2797] = "Service de radio Internet";
    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "I2P+ fonctionne mieux lorsque vous pouvez refl\u00e9ter avec pr\u00e9cision la vitesse de votre connexion r\u00e9seau dans la section <a href=/config>configuration de bande passante</a>. Par d\u00e9faut, I2P+ est configur\u00e9 avec des valeurs assez conservatrices qui ne conviendront pas \u00e0 de nombreux cas d'usage, prenez donc le temps de revoir ces r\u00e9glages et de corriger le cas \u00e9ch\u00e9ant. Plus vous allouez de bande passante, <i>plus pr\u00e9cis\u00e9ment</i> de bande passante montante, plus vous profiterez du r\u00e9seau.";
    t[2810] = "Transit by Peer";
    t[2811] = "Transit par pair";
    t[2812] = "Hidden Mode";
    t[2813] = "Mode cach\u00e9";
    t[2814] = "Plugin requires Jetty version {0} or lower";
    t[2815] = "Le greffon exige Jetty version {0} ou ant\u00e9rieure";
    t[2822] = "The proxy may be remotely hosted or a service running on your computer (localhost/127.0.0.1).";
    t[2823] = "Le proxy peut \u00eatre h\u00e9berg\u00e9 \u00e0 distance ou un service ex\u00e9cut\u00e9 sur votre ordinateur (localhost/127.0.0.1).";
    t[2824] = "Events in peak period";
    t[2825] = "\u00c9v\u00e9nements en p\u00e9riode de pointe";
    t[2838] = "Router Console &amp; WebApps Display Language";
    t[2839] = "Console et amplificateur de routeur Langue d'affichage des applications Web";
    t[2844] = "What to do in the event I2P+ isn't working";
    t[2845] = "Que faire si I2P ne fonctionne pas";
    t[2856] = "ANONYMITY WARNING - Settings include 1-hop tunnels.";
    t[2857] = "AVERTISSEMENT d\u2019ANONYMAT: Les param\u00e8tres incluent des tunnels \u00e0 1 saut.";
    t[2858] = "I2P IRC Network";
    t[2859] = "r\u00e9seau I2P IRC";
    t[2864] = "pixels wide";
    t[2865] = "pixels de large";
    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "Le protocole r\u00e9seau I2P (I2NP) g\u00e8re l'acheminement et le m\u00e9lange des messages entre les routeurs, en plus de la s\u00e9lection du transport (lorsque plusieurs sont support\u00e9s) lors de la communication avec un pair. Pour plus d'informations, consultez la <a href=https://geti2p.net/fr/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>documentation en ligne</a>.";
    t[2884] = "Expired {0} ago";
    t[2885] = "Expir\u00e9 il y a {0}";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "Statut de votre routeur pour accepter ou rejeter les demandes des autres routeurs de construire un tunnel de participation \u00e0 travers votre routeur. Votre routeur peut accepter toutes les demandes, accepter ou rejeter un pourcentage des demandes, ou rejeter toutes les demandes pour diverses raisons, afin de contr\u00f4ler la bande passante et les exigences de CPU et de maintenir la capacit\u00e9 pour les clients locaux. <b>Remarque";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "Veuillez contacter un ami de confiance connu qui dispose d'un routeur I2P fonctionnel, et demandez-lui de l'aide pour le r\u00e9ensemencement de votre routeur I2P. Demandez-lui de vous envoyer un fichier de r\u00e9ensemencement export\u00e9 \u00e0 partir de son routeur I2P fonctionnel. Il est essentiel que le fichier soit \u00e9chang\u00e9 par un canal s\u00e9curis\u00e9, par exemple chiffr\u00e9 pour \u00e9viter une alt\u00e9ration externe (signature PGP, chiffrement et v\u00e9rification avec une cl\u00e9 publique de confiance). Le fichier lui-m\u00eame n'est pas sign\u00e9, aussi veuillez accepter les fichiers uniquement de la part d'amis de confiance connus. N'importez jamais un fichier de r\u00e9ensemencement si vous ne pouvez pas v\u00e9rifier sa provenance.";
    t[2916] = "Last Good Send";
    t[2917] = "Dernier bon envoi";
    t[2918] = "Delete this value to disable";
    t[2919] = "Supprimer cette valeur pour d\u00e9sactiver";
    t[2920] = "You can use a recorder in one tunnel that writes to a file that another tunnel, or multiple tunnels, can use for throttling. These files can also be edited by hand.";
    t[2921] = "Vous pouvez utiliser un enregistreur dans un tunnel qui \u00e9crit dans un fichier qu'un autre tunnel, ou plusieurs tunnels, peuvent utiliser pour le d\u00e9bit limite. Ces fichiers peuvent \u00e9galement \u00eatre modifi\u00e9s manuellement.";
    t[2924] = "Router running a non-native, software emulated version of the Java BigInteger library";
    t[2925] = "Routeur ex\u00e9cutant une version logicielle \u00e9mul\u00e9e non native de la biblioth\u00e8que Java BigInteger";
    t[2928] = "Country";
    t[2929] = "Pays";
    t[2934] = "Peer's clockskew relative to our clock";
    t[2935] = "l'horloge de Peer est d\u00e9cal\u00e9e par rapport \u00e0 notre horloge";
    t[2936] = "A threshold that if breached will cause the offending remote destination to be recorded in a specified file";
    t[2937] = "Un seuil qui, s'il est viol\u00e9, entra\u00eenera la consignation de la destination distante incrimin\u00e9e dans un fichier sp\u00e9cifi\u00e9";
    t[2938] = "This is usually due to a port 7654 conflict. Check the logs to verify.";
    t[2939] = "Cela est habituellement caus\u00e9 par un conflit du port 7654. Consulter les journaux pour v\u00e9rifier.";
    t[2940] = "Disabling inbound TCP";
    t[2941] = "D\u00e9sactivation du TCP entrant";
    t[2944] = "Keyring";
    t[2945] = "Trousseau";
    t[2946] = "Verified family (signing certificate is installed and valid)";
    t[2947] = "Famille v\u00e9rifi\u00e9e (le certificat de signature est install\u00e9 et valide)";
    t[2954] = "Router info not available";
    t[2955] = "Informations sur le routeur non disponibles";
    t[2956] = "The Java web applications listed below are started by the webConsole client and run in the same JVM as the router. They are usually web applications accessible through the router console. They may be complete applications (e.g. i2psnark), front-ends to another client or application which must be separately enabled (e.g. susidns, i2ptunnel), or have no web interface at all (e.g. addressbook).";
    t[2957] = "Les applications Web Java list\u00e9es ci-dessous sont d\u00e9marr\u00e9es par le client webConsole et s\u2019ex\u00e9cutent dans la m\u00eame MVJ que le routeur. Elles sont g\u00e9n\u00e9ralement des applications Web accessibles par la console du routeur. Elles peuvent \u00eatre des applications compl\u00e8tes (p. ex.: i2pSnark), des frontales pour d\u2019autres clients ou des applications qui doivent \u00eatre activ\u00e9es s\u00e9par\u00e9ment (p. ex.: susidns, i2ptunnel) ou n\u2019avoir aucune interface Web (p. ex.: le carnet d\u2019adresses).";
    t[2960] = "WARNING - Inbound 0-hop tunnels not recommended for hidden routers.";
    t[2961] = "AVERTISSEMENT \u2013 Les tunnels entrants \u00e0 saut 0 ne sont pas recommand\u00e9s pour les routeurs cach\u00e9s.";
