    t[2978] = "This is the total number of peers that are known by your router. They are listed on the <a href='/netdb'>Network Database page</a>. This may range from under 100 to 1000 or more. This number is not the total size of the network; it may vary widely depending on your total bandwidth, shared bandwidth, and locally-generated traffic. I2P does not require a router to know every other router in the network.";
    t[2979] = "C'est le nombre total de pairs connus par votre routeur. Ils sont r\u00e9pertori\u00e9s sur la page <a href='/netdb'>Base de donn\u00e9es r\u00e9seau</a>. Cela peut aller de moins de 100 \u00e0 1000 ou plus. Ce nombre ne correspond pas \u00e0 la taille totale du r\u00e9seau ; il peut varier grandement selon votre bande passante totale, votre bande passante partag\u00e9e et le trafic g\u00e9n\u00e9r\u00e9 localement. I2P n'exige pas qu'un routeur connaisse tous les autres routeurs du r\u00e9seau.";
