    t[3062] = "You can override the <a href=http://127.0.0.1:7658/help/images/>default appearance</a> of the directory listing by supplying an edited <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> file to set a global appearance. Note that this file will not be displayed in the webserver's directory listing. Files and directories prefixed with . and files named favicon.ico or files ending with ~ or .bak or .old will also be hidden from view (though still accessible). Note: To create hidden files with a . prefix on Windows, add a trailing . to the file or directory e.g. <code>.hidden.</code>; Windows explorer will then save the file with the correct name, removing the trailing dot in the process.";
    t[3063] = "Vous pouvez remplacer l'<a href=http://127.0.0.1:7658/help/images/>apparence par d\u00e9faut</a> de la liste de r\u00e9pertoires en fournissant un fichier <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> modifi\u00e9 pour d\u00e9finir une apparence globale. Notez que ce fichier ne sera pas affich\u00e9 dans la liste de r\u00e9pertoires du serveur web. Les fichiers et r\u00e9pertoires pr\u00e9fix\u00e9s par . et les fichiers nomm\u00e9s favicon.ico ou se terminant par ~ ou .bak ou .old seront \u00e9galement masqu\u00e9s (bien qu'encore accessibles). Remarque : pour cr\u00e9er des fichiers cach\u00e9s avec un pr\u00e9fixe . sous Windows, ajoutez un point final au fichier ou r\u00e9pertoire, par exemple <code>.hidden.</code> ; Windows explorer enregistrera alors le fichier avec le nom correct, en supprimant le point final dans le processus.";
