    t[3188] = "When set to true, additional functionality will be enabled in the console and the user will be able to edit settings directly on the <a href=/configadvanced>Advanced Configuration page</a>. Extra display options are provided in the <a href=/netdb>Network Database section</a>, including the <a href='/netdb?f=3'>Sybil Analysis tool</a>, and there are additional configuration options on the <a href=/configclients>Clients Configuration page</a>. This will also enable the installation of unsigned updates, manual configuration of the news URL, and additional sections on the sidebar.";
    t[3189] = "Lorsqu'il est d\u00e9fini sur true, des fonctionnalit\u00e9s suppl\u00e9mentaires seront activ\u00e9es dans la console et l'utilisateur pourra modifier directement les param\u00e8tres sur la page <a href=/configadvanced>Configuration avanc\u00e9e</a>. Des options d'affichage suppl\u00e9mentaires sont disponibles dans la section <a href=/netdb>Base de donn\u00e9es r\u00e9seau</a>, y compris l'<a href='/netdb?f=3'>outil d'analyse Sybil</a>, et des options de configuration suppl\u00e9mentaires sont disponibles sur la page <a href=/configclients>Configuration des clients</a>. Cela activera \u00e9galement l'installation de mises \u00e0 jour non sign\u00e9es, la configuration manuelle de l'URL des actualit\u00e9s et des sections suppl\u00e9mentaires dans la barre lat\u00e9rale.";
