    t[3486] = "This is the number of peers your router has available for building client tunnels. It is generally in the range 8-30. Your fast peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.fastPeers'>[Enable graphing]</a>";
    t[3487] = "C'est le nombre de pairs disponibles pour la construction des tunnels clients par votre routeur. Il se situe g\u00e9n\u00e9ralement entre 8 et 30. Vos pairs rapides sont affich\u00e9s sur la page <a href='/profiles'>Profils</a>. <a href='/configstats#router.fastPeers'>[Activer le graphique]</a>";
    t[3488] = "Click the <i>Reseed from File</i> button";
    t[3489] = "Cliquez sur le bouton <i>R\u00e9ensemencement \u00e0 partir d'un fichier</i>";
    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "Une variante de l'acheminement en oignon qui chiffre plusieurs messages ensemble pour rendre plus difficile pour les attaquants d'effectuer une analyse du trafic et d'augmenter la vitesse de transfert des donn\u00e9es. Pour plus d'informations, consultez la <a href=https://geti2p.net/fr/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>documentation en ligne</a>.";
    t[3494] = "How to Harden Your WordPress Site";
    t[3495] = "Comment renforcer votre site WordPress";
    t[3496] = "I2P Internals";
    t[3497] = "Composantes internes d\u2019I2P";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "Par d\u00e9faut, I2P est fourni avec un serveur web pour h\u00e9berger votre propre site anonymis\u00e9 (traditionnellement appel\u00e9 un <i>eepsite</i>). \u00c0 la fois le site et la Console de routeur I2P fonctionnent sur une version all\u00e9g\u00e9e de <a href='https://fr.wikipedia.org/wiki/Jetty_(serveur_Web)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, personnalis\u00e9e pour I2P.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "Ce param\u00e8tre vous permet d'exclure les routeurs plus anciens de votre NetDb. Les routeurs plus anciens que la valeur par d\u00e9faut ou la valeur que vous d\u00e9finissez seront supprim\u00e9s de la NetDb et interdits pour la dur\u00e9e de la session du routeur. Par d\u00e9faut, les routeurs plus anciens que la version 0.9.20 sont exclus. Remarque : \u00e0 partir de la version 0.9.46+ d'I2P+, seuls les routeurs fonctionnant avec les toutes derni\u00e8res versions sont utilis\u00e9s pour la construction des tunnels locaux. [Red\u00e9marrage requis]";
