    t[3546] = "This setting, in milliseconds, overrides the default message processing time limit (indicated as <i>Message Delay</i> in the Congestion sidebar section) before the router is determined to be congested and transit tunnel requests are rejected. [Default is 750ms or 1500ms if the router is flagged as slow]";
    t[3547] = "Ce param\u00e8tre, en millisecondes, remplace la limite de temps de traitement des messages par d\u00e9faut (indiqu\u00e9e comme <i>D\u00e9lai de message</i> dans la section lat\u00e9rale de congestion) avant que le routeur ne soit d\u00e9termin\u00e9 comme congestionn\u00e9 et que les demandes de tunnels de transit ne soient rejet\u00e9es. [Valeur par d\u00e9faut 750ms ou 1500ms si le routeur est signal\u00e9 comme lent]";
