    t[3634] = "Official I2P Source Repository";
    t[3635] = "R\u00e9f\u00e9rentiel source officiel I2P";
    t[3638] = "Outbound UDP on port 123, allowing replies: this is necessary for I2P's internal time sync (via SNTP - querying a random SNTP host in <code>pool.ntp.org</code> or <a href=/help/advancedsettings#ntpserverconfig>another server you specify</a>).";
    t[3639] = "UDP sortant sur le port 123, autorisant les r\u00e9ponses : cela est n\u00e9cessaire pour la synchronisation horaire interne d'I2P (via SNTP - interrogation d'un h\u00f4te SNTP al\u00e9atoire dans <code>pool.ntp.org</code> ou <a href=/help/advancedsettings#ntpserverconfig>un autre serveur que vous sp\u00e9cifiez</a>).";
    t[3646] = "NetDb Search";
    t[3647] = "Recherche NetDb";
    t[3654] = "XChat-like client users can create a new network with the server <code>127.0.0.1/6668</code> (remember to tick <i>Bypass proxy server</i> if you have a proxy server configured), or you can connect with the command <code>/server 127.0.0.1 6668</code>. Different IRC clients may vary the syntax.";
    t[3655] = "Les utilisateurs de clients similaires \u00e0 XChat peuvent cr\u00e9er un nouveau r\u00e9seau avec le serveur <code>127.0.0.1/6668</code> (n'oubliez pas de cocher <i>Contourner le serveur proxy</i> si vous avez configur\u00e9 un serveur proxy), ou vous pouvez vous connecter avec la commande <code>/server 127.0.0.1 6668</code>. La syntaxe peut varier selon les clients IRC.";
