    t[3704] = "The router configuration options listed below are not available in the user interface, usually because they are rarely used or provide access to advanced settings that most users will not need. This is not a comprehensive list. Some settings will require a restart of the router to take effect. Note that all settings are case sensitive. You will need to edit your <code>router.config</code> file to add options, or, once you have added <code>routerconsole.advanced=true</code> to the router.config file, you may edit settings within the console on the <a href=/configadvanced>Advanced Configuration page</a>.";
    t[3705] = "Les options de configuration du routeur ci-dessous ne sont g\u00e9n\u00e9ralement pas disponibles dans l'interface utilisateur, car elles sont rarement utilis\u00e9es ou donnent acc\u00e8s \u00e0 des param\u00e8tres avanc\u00e9s dont la plupart des utilisateurs n'ont pas besoin. Ceci n'est pas une liste exhaustive. Certains param\u00e8tres n\u00e9cessiteront un red\u00e9marrage du routeur pour prendre effet. Notez que tous les param\u00e8tres sont sensibles \u00e0 la casse. Vous devrez modifier votre fichier <code>router.config</code> pour ajouter des options ou, une fois que vous avez ajout\u00e9 <code>routerconsole.advanced=true</code> au fichier router.config, vous pouvez modifier les param\u00e8tres dans la console sur la page <a href=/configadvanced>Configuration avanc\u00e9e</a>.";
