    t[3754] = "When set to true, your router will not be classified as slow, regardless of the specifications of your host system. Ordinarily, routers running on hosts with the following characteristics will be classified as slow, and various performance-related router options will be modified accordingly:";
    t[3755] = "Lorsqu'il est d\u00e9fini sur true, votre routeur ne sera pas class\u00e9 comme lent, quelles que soient les sp\u00e9cifications de votre syst\u00e8me h\u00f4te. Normalement, les routeurs fonctionnant sur des h\u00f4tes pr\u00e9sentant les caract\u00e9ristiques suivantes seront class\u00e9s comme lents, et diverses options de routeur li\u00e9es aux performances seront modifi\u00e9es en cons\u00e9quence :";
