    t[3780] = "To preserve anonymity, make sure that the webserver is not publicly available outside of the I2P network, which is normally achieved by configuring the webserver to listen on localhost (127.0.0.1) rather than all interfaces (0.0.0.0).";
    t[3781] = "Pour pr\u00e9server votre anonymat, assurez-vous que le serveur Web ne soit pas accessible publiquement en dehors du r\u00e9seau I2P, ce qui est normalement obtenu en configurant le serveur Web pour \u00e9couter sur localhost (127.0.0.1) plut\u00f4t que sur toutes les interfaces (0.0.0.0).";
