    t[3839] = "Pour un guide plus complet sur la configuration pour diff\u00e9rents navigateurs, voir le <a href=https://geti2p.net/fr/about/browser-config target=_blank rel=noreferrer class='sitelink external'>guide de configuration de navigateur</a>..";
    t[3842] = "Periodically test tunnels to determine the average lag, and display the results in the Congestion sidepanel section. To enable, set this value to false. [Default is false]";
