    t[3960] = "Just finished jobs";
    t[3961] = "Travaux venant de se terminer";
    t[3962] = "Some IRC clients are configured to disconnect from the server if there's been no communication with the server for a period of time, which can sometimes be problematic for I2P IRC if the <i>ping timeout</i> value is set too low. Setting the ping timeout value in your client to a high value (e.g. 320 seconds) will often result in a more robust connection to the network. In hexchat you can configure the value by typing <code>/set net_ping_timeout 320</code>. This will write the value to your <code>hexchat.conf</code> file.";
    t[3963] = "Certains clients IRC sont configur\u00e9s pour se d\u00e9connecter du serveur s'il n'y a pas eu de communication avec le serveur pendant une p\u00e9riode donn\u00e9e, ce qui peut parfois poser probl\u00e8me pour l'IRC I2P si la valeur de <i>timeout de ping</i> est r\u00e9gl\u00e9e trop bas. Le fait de r\u00e9gler la valeur de timeout de ping dans votre client \u00e0 une valeur \u00e9lev\u00e9e (par exemple 320 secondes) aboutira souvent \u00e0 une connexion plus robuste au r\u00e9seau. Sur Hexchat, vous pouvez configurer la valeur en tapant <code>/set net_ping_timeout 320</code>. Cela \u00e9crira la valeur dans votre fichier <code>hexchat.conf</code>.";
    t[3964] = "Run at Startup?";
    t[3965] = "Lancer au d\u00e9marrage\u2009?";
    t[3972] = "Never";
    t[3973] = "Jamais";
    t[3978] = "An <a href=/confignet#ipchange>optional configuration</a> that automatically changes your <a href=/netdb?r=.>router identity</a> and <a href=/confignet#udpconfig>external port</a> when the public ip address your system is on changes. This can prevent an adversary from correlating your router identity and ip address in scenarios where your ip address may change frequently, for example when you're running I2P on a laptop from multiple locations.";
    t[3979] = "Une <a href=/confignet#ipchange>configuration optionnelle</a> qui change automatiquement votre <a href=/netdb?r=.>identit\u00e9 de routeur</a> et votre <a href=/confignet#udpconfig>port externe</a> lorsque l'adresse IP publique de votre syst\u00e8me change. Cela peut emp\u00eacher qu'un adversaire corr\u00e8le votre identit\u00e9 de routeur et votre adresse IP dans des sc\u00e9narios o\u00f9 votre adresse IP peut changer fr\u00e9quemment, par exemple lorsque vous ex\u00e9cutez I2P sur un ordinateur portable depuis plusieurs endroits.";
    t[3982] = "The router is not configured to publish its address, therefore it does not expect incoming connections.";
    t[3983] = "Le routeur n\u2019est pas configur\u00e9 pour publier son adresse, il n\u2019attend donc pas de connexion entrante.";
    t[3998] = "A command-line application supplied with I2P+ (Linux/MacOS) that is used to perform a <code>head</code> request on a specified http resource on the network, returning various response headers from the remote server. By default, eephead uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
