    t[4332] = "Note: The order of the declarations matters. The first threshold declaration for a given destination (whether explicit or listed in a referenced file) overrides any future thresholds for the same destination, whether explicit or listed in a file. Note: to apply a new filter file, the tunnel must be restarted after the location has been specified in the tunnel manager. Once configured, a definition file can be updated without requiring a restart of the target tunnel, although destinations that are blocked will persist until the tunnel is restarted.";
    t[4333] = "Note: L'ordre des d\u00e9clarations est important. La premi\u00e8re d\u00e9claration de seuil pour une destination donn\u00e9e (explicite ou r\u00e9pertori\u00e9e dans un fichier r\u00e9f\u00e9renc\u00e9) \u00e9crase tout seuil ult\u00e9rieur pour la m\u00eame destination, explicite ou r\u00e9pertori\u00e9e dans un fichier. Note: pour appliquer un nouveau fichier filtre, le tunnel doit \u00eatre red\u00e9marr\u00e9 apr\u00e8s que l'emplacement a \u00e9t\u00e9 sp\u00e9cifi\u00e9 dans le gestionnaire de tunnel. Une fois configur\u00e9, un fichier de d\u00e9finition peut \u00eatre mis \u00e0 jour sans red\u00e9marrage du tunnel cible, bien que les destinations bloqu\u00e9es persistent jusqu'au red\u00e9marrage du tunnel.";
