    t[4670] = "The version of the I2P software you are running. If a new version is available, you will be notified in the Sidebar. It is recommended to keep your router up to date to ensure optimal performance and security. Router updates are usually made available on average every 2-3 months.";
    t[4671] = "La version du logiciel I2P que vous utilisez. Si une nouvelle version est disponible, vous en serez notifi\u00e9 dans la barre lat\u00e9rale. Il est recommand\u00e9 de garder votre routeur \u00e0 jour pour assurer des performances et une s\u00e9curit\u00e9 optimales. Les mises \u00e0 jour du routeur sont g\u00e9n\u00e9ralement rendues disponibles en moyenne tous les 2 \u00e0 3 mois.";
