    t[4822] = "Be aware that a poorly configured webserver or web appplication can leak information such as your real IP address or server details that may reduce your anonymity or assist a hacker. If using an alternative platform, be sure to secure it before putting it online. If in doubt, consult online guides about web server and web application hardening, for example:";
    t[4823] = "Soyez conscient qu'un serveur Web ou une application web mal configur\u00e9s peuvent faire fuiter des informations comme votre adresse IP r\u00e9elle ou des d\u00e9tails sur le serveur qui peuvent r\u00e9duire votre anonymat ou aider un pirate informatique. Si vous utilisez une plate-forme alternative, assurez-vous de la s\u00e9curiser avant de la mettre en ligne. En cas de doute, consultez des guides en ligne sur le renforcement de la s\u00e9curit\u00e9 des serveurs Web et des applications Web, par exemple :";
