    t[4930] = "This setting, when configured with a path pointing at a valid blocklist file, enables an additional, user-configured blocklist to be loaded at router startup. [Disabled by default, restart required]";
    t[4931] = "Ce param\u00e8tre, lorsqu'il est configur\u00e9 avec un chemin pointant vers un fichier de liste de blocage valide, permet de charger une liste de blocage suppl\u00e9mentaire configur\u00e9e par l'utilisateur au d\u00e9marrage du routeur. [D\u00e9sactiv\u00e9 par d\u00e9faut, red\u00e9marrage requis]";
    t[4932] = "I2P+ supports custom theme overrides for the console, the tunnel manager, I2PSnark, SusiDNS and Susimail, permitting changes to the themes which are persistent after upgrades. In order to activate an override, create a css file named <code>override.css</code> with your theme modifications and place it in the relevant theme directory of the theme you wish to change, or rename one of the example files, and then hard refresh the browser. Note that the tunnel manager and the console share the same override.css. To deactivate an override, delete or rename the <code>override.css</code> file and then hard refresh the browser (usually Control + Shift + R).";
    t[4933] = "I2P+ prend en charge les remplacements de th\u00e8mes personnalis\u00e9s pour la console, le gestionnaire de tunnels, I2PSnark, SusiDNS et Susimail, autorisant des modifications dans les th\u00e8mes persistantes apr\u00e8s les mises \u00e0 niveau. Pour activer un remplacement, cr\u00e9ez un fichier css nomm\u00e9 <code>override.css</code> contenant vos modifications de th\u00e8me et placez-le dans le r\u00e9pertoire de th\u00e8me correspondant du th\u00e8me que vous souhaitez modifier, ou renommez l'un des fichiers d'exemple, puis effectuez un rechargement forc\u00e9 du navigateur. Notez que le gestionnaire de tunnels et la console partagent le m\u00eame override.css. Pour d\u00e9sactiver un remplacement, supprimez ou renommez le fichier <code>override.css</code> puis effectuez un rechargement forc\u00e9 du navigateur (habituellement Control + Maj + R).";
