    t[5042] = "When set to true, this setting enables reverse DNS lookups for peers, triggered when displaying the country flag of a peer or when the hostname or domain is explicitly displayed in the console, or when the peer's RouterInfo is written to disk. In order to avoid repeat lookups, it's recommended to configure a generous caching policy for DNS lookups of 10 minutes or more, and to configure a privacy respecting DNS server in your operating system. [Disabled by default, restart required]";
    t[5043] = "Lorsqu'il est d\u00e9fini sur true, ce param\u00e8tre active les recherches DNS inverses pour les pairs, d\u00e9clench\u00e9es lors de l'affichage du drapeau du pays d'un pair ou lorsque le nom d'h\u00f4te ou le domaine est explicitement affich\u00e9 dans la console, ou lorsque le RouterInfo du pair est \u00e9crit sur disque. Afin d'\u00e9viter les recherches r\u00e9p\u00e9t\u00e9es, il est recommand\u00e9 de configurer une politique de mise en cache g\u00e9n\u00e9reuse pour les recherches DNS de 10 minutes ou plus, et de configurer un serveur DNS respectueux de la vie priv\u00e9e dans votre syst\u00e8me d'exploitation. [D\u00e9sactiv\u00e9 par d\u00e9faut, red\u00e9marrage requis]";
