    t[5084] = "If you're running a dynamic site handling a large number of concurrent users, content caching can often improve the time taken to deliver pages. For content that rapidly changes, a <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>micro-caching strategy</a> may still yield some benefits. The <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx webserver</a> provides a competent caching sub-system, or for a more heavy-weight solution, have a look at <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
    t[5085] = "Si vous h\u00e9bergez un site dynamique avec un grand nombre d'utilisateurs simultan\u00e9s, la mise en cache du contenu peut souvent am\u00e9liorer le d\u00e9lai de livraison des pages. Pour un contenu \u00e0 actualisation fr\u00e9quente, une strat\u00e9gie de <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>micro-mise en cache</a> peut encore pr\u00e9senter certains avantages. Le serveur Web <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx</a> propose un sous-syst\u00e8me de mise en cache comp\u00e9tent, ou pour une solution plus robuste, jetez un \u0153il \u00e0 <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
