    t[5330] = "The default subscription is to <code>http://i2p-projekt.i2p/hosts.txt</code> which is seldom updated. If you don't have another subscription, you may often have to use \"jump\" links which is much slower but ensures that your addressbook is only populated by sites you use (in addition to the default subscription addresses). To speed up browsing on I2P, it's a good idea to add some addressbook subscriptions.";
    t[5331] = "L'abonnement par d\u00e9faut est \u00e0 <code>http://i2p-projekt.i2p/hosts.txt</code> qui est rarement mis \u00e0 jour. Si vous n'avez pas d'autre abonnement, vous devrez souvent utiliser des liens \"sauts\" qui sont beaucoup plus lents mais garantissent que votre carnet d'adresses ne contient que les sites que vous utilisez (en plus des adresses de l'abonnement par d\u00e9faut). Pour acc\u00e9l\u00e9rer la navigation sur I2P, il est bon d'ajouter quelques abonnements au carnet d'adresses.";
