    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "Si apr\u00e8s quelques minutes d'activit\u00e9 votre routeur indique 0 pairs actifs et 0 pairs connus, avec une notification dans la barre lat\u00e9rale vous invitant \u00e0 v\u00e9rifier votre connexion r\u00e9seau, v\u00e9rifiez que vous pouvez acc\u00e9der \u00e0 Internet. Si votre connexion Internet fonctionne, il peut s'av\u00e9rer n\u00e9cessaire de d\u00e9bloquer Java dans votre pare-feu. Sinon, vous devrez proc\u00e9der \u00e0 une nouvelle phase de d\u00e9clenchement pour votre routeur I2P. Rendez-vous sur la page <a href=/configreseed#reseedconfig>Configuration de d\u00e9clenchement</a> et cliquez sur le bouton <i>Enregistrer les modifications et d\u00e9clencher maintenant</i>. Pour plus d'informations, consultez la section <a href=#reseedhelp>Aide au d\u00e9clenchement</a> ci-dessus.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "Une API de socket de niveau sup\u00e9rieur pour les clients. Seulement ouvert lorsqu'un client SAM V3 demande une session UDP. Peut \u00eatre activ\u00e9/d\u00e9sactiv\u00e9 sur la page <a href=/configclients> Configuration client</a>. Peut \u00eatre modifi\u00e9 dans le fichier <code>clients.config</code> avec l'option de ligne de commande SAM <code>sam.udp.port=nnnn</code>.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "Si vous souhaitez que votre site ait l'air r\u00e9actif, la compression des images est essentielle lors de l'h\u00e9bergement d'images volumineuses. L'utilisation d'un service comme <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> pour compresser vos images PNG et JPG aboutira souvent \u00e0 des fichiers beaucoup plus petits avec une perte minime de qualit\u00e9. Dans certains cas, le format webp peut surpasser les JPG en g\u00e9n\u00e9rant des fichiers plus petits avec une fid\u00e9lit\u00e9 visuelle approximativement identique ou meilleure, et il b\u00e9n\u00e9ficie d'un large support des navigateurs. Pensez \u00e9galement \u00e0 utiliser des svg plut\u00f4t que des pixmaps pour les ic\u00f4nes et illustrations - ils sont souvent plus petits que le fichier pixmap \u00e9quivalent (faites-les passer \u00e0 travers un service comme <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> pour supprimer les \u00e9l\u00e9ments inutiles), s'adaptent \u00e0 l'\u00e9chelle sans perte de qualit\u00e9, et peuvent \u00eatre compress\u00e9s par gzip par votre serveur web.";
    t[5528] = "UPnP disabled on the device";
    t[5529] = "UPnP est d\u00e9sactiv\u00e9 sur le dispositif";
    t[5536] = "By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels (for performance reasons) and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i> in the sidebar under Service Tunnels and on the <a href=/tunnels>Tunnels page</a>.";
    t[5537] = "Par d\u00e9faut, la plupart de vos services clients (courriel, proxy HTTP, IRC) partageront le m\u00eame ensemble de tunnels (pour des raisons de performance) et seront r\u00e9pertori\u00e9s sous <i>Clients partag\u00e9s</i> et <i>Clients partag\u00e9s (DSA)</i> dans la barre lat\u00e9rale sous Tunnels de service et sur la page <a href=/tunnels>Tunnels</a>.";
