    t[5544] = "This section is not enabled by default unless <a href='/help/configuration#advancedconsole'>Advanced Console mode</a> is enabled. You may enable it on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[5545] = "Cette section n'est pas activ\u00e9e par d\u00e9faut \u00e0 moins que le <a href='/help/configuration#advancedconsole'>mode Console avanc\u00e9e</a> ne soit activ\u00e9. Vous pouvez l'activer sur la page de <a href='/configsidebar'>configuration de la barre lat\u00e9rale</a>.";
