    t[5556] = "Also, some routers cannot correctly forward both TCP and UDP on a single port, or may have other limitations or bugs that prevent them from passing traffic through to I2P.";
    t[5557] = "De plus, certains pare-feu ne peuvent pas r\u00e9acheminer correctement \u00e0 la fois le TCP et l\u2019UDP sur un m\u00eame port ou pourraient avoir d\u2019autres restrictions ou bogues qui les emp\u00eacheraient de passer le trafic \u00e0 I2P.";
