    t[5712] = "Firewalled with Inbound TCP Enabled";
    t[5713] = "Pare-feu avec TCP entrant activ\u00e9";
    t[5716] = "Open <a href=/confignet#udpconfig>I2P+'s port</a> on your modem, router and/or firewall(s) for better connectivity (ideally both UDP and TCP). More information on how to go about port forwarding can be found at <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, in addition to our forums and IRC channels listed below. Note that I2P does not support connecting to the internet via an http or socks proxy [patches welcome!], though you can connect to proxies via I2P itself once connected to the network.";
    t[5717] = "Ouvrez le <a href=/confignet#udpconfig>port d'I2P+</a> sur votre modem, routeur et/ou pare-feu(x) pour am\u00e9liorer la connectivit\u00e9 (id\u00e9alement UDP et TCP). Vous trouverez plus d'informations sur le transfert de ports sur <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, ainsi que sur nos forums et canaux IRC ci-dessous. Notez qu'I2P ne supporte pas la connexion \u00e0 Internet via un proxy http ou socks [patches les bienvenus !], m\u00eame si vous pouvez vous connecter \u00e0 des proxys via I2P une fois connect\u00e9 au r\u00e9seau.";
    t[5730] = "A tunnel filter can provide protection against denial of service attacks, without otherwise interrupting the service for genuine users, either in conjunction with the tunnel throttler or as an alternative strategy. It can also be used to log access to a hosted service to determine if the server is under attack, or simply to log all visitors by I2P destination. Additionally, a filter can function simultaneously as a whitelist and blacklist making it more flexible than the Tunnel Manager's access list controls. Note that multiple server tunnels can share a single filter file if you wish to implement a global filter.";
    t[5731] = "Un filtre de tunnel peut assurer une protection contre les attaques par d\u00e9ni de service, sans perturber par ailleurs le service pour les utilisateurs l\u00e9gitimes, soit conjointement avec le r\u00e9gulateur de tunnel soit comme strat\u00e9gie alternative. Il peut aussi servir \u00e0 journaliser l'acc\u00e8s \u00e0 un service h\u00e9berg\u00e9 pour d\u00e9terminer si le serveur est sous attaque ou simplement consigner tous les visiteurs par destination I2P. De plus, un filtre peut fonctionner simultan\u00e9ment comme liste blanche et liste noire, ce qui le rend plus flexible que les contr\u00f4les de liste d'acc\u00e8s du Gestionnaire de tunnel. Notez que plusieurs tunnels serveur peuvent partager un seul fichier filtre si vous souhaitez impl\u00e9menter un filtre global.";
