    t[6026] = "This setting (in milliseconds) allows you to manually configure the delay between router refresh updates run by the Refresh Routers Job. By default the pause between refreshes is determined by the size of the NetDb, and introduces some randomness in the timing to mitigate traffic analysis. For values lower than 2000 milliseconds, increasing the value of <code>router.refreshTimeout</code> is recommended. Note that setting this value below 2000 milliseconds will increase your network traffic and may introduce job lag, and is not recommended for sustained use.";
    t[6027] = "Ce param\u00e8tre (en millisecondes) vous permet de configurer manuellement le d\u00e9lai entre les mises \u00e0 jour de rafra\u00eechissement des routeurs ex\u00e9cut\u00e9es par la t\u00e2che Refresh Routers Job. Par d\u00e9faut, la pause entre les rafra\u00eechissements est d\u00e9termin\u00e9e par la taille de la NetDb, et introduit une certaine al\u00e9atoire dans le temps pour att\u00e9nuer l'analyse du trafic. Pour des valeurs inf\u00e9rieures \u00e0 2000 millisecondes, il est recommand\u00e9 d'augmenter la valeur de <code>router.refreshTimeout</code>. Notez qu'un r\u00e9glage de cette valeur sous les 2000 millisecondes augmentera votre trafic r\u00e9seau et pourrait introduire un retard de t\u00e2che, ce qui n'est pas recommand\u00e9 pour une utilisation durable.";
    t[6030] = "Server tunnels, configurable in the <a href=/i2ptunnelmgr>Tunnel Manager</a>, provide a number of ways to limit access to the hosted service. Destination whitelisting, blacklisting, connection throttling, and tunnel filtering are methods provisioned to mitigate denial of service attacks, grant exclusive access to known I2P destinations, and manage traffic to the server.";
    t[6031] = "Les tunnels serveur, configurables dans le <a href=/i2ptunnelmgr>Gestionnaire de tunnel</a>, proposent plusieurs moyens de limiter l'acc\u00e8s au service h\u00e9berg\u00e9. Le filtrage par liste blanche et liste noire des destinations, le limitation des connexions et le filtrage de tunnel sont des m\u00e9thodes pr\u00e9vues pour att\u00e9nuer les attaques par d\u00e9ni de service, accorder un acc\u00e8s exclusif aux destinations I2P connues et g\u00e9rer le trafic vers le serveur.";
