    t[6214] = "Do not reveal this file to unknown users, as it contains sensitive data (100 RouterInfo files) from your own I2P router which potentially could be used by an adversary to decloak your identity. In order to protect your anonymity: you should wait for a few hours/days before sharing the file with your trusted friend. It is also advisable to use this procedure sparingly (no more than once a week).";
    t[6215] = "Ne r\u00e9v\u00e9lez pas ce fichier \u00e0 des utilisateurs inconnus, car il contient des donn\u00e9es sensibles (100 fichiers RouterInfo) provenant de votre propre routeur I2P qui pourraient potentiellement \u00eatre utilis\u00e9es par un adversaire pour d\u00e9cloak votre identit\u00e9. Afin de prot\u00e9ger votre anonymat : vous devriez attendre quelques heures/jours avant de partager le fichier avec votre ami de confiance. Il est \u00e9galement conseill\u00e9 d'utiliser cette proc\u00e9dure avec parcimonie (pas plus d'une fois par semaine).";
