    t[6244] = "The act of contributing to the network by permitting other routers to build tunnels using your router in a tunnel chain. At least 12KB/s upstream bandwidth (network share) is required to be allocated in order to enable participation. Note that firewalled routers will be limited in how much they contribute to participation, and a router designated as Hidden will not participate at all.";
    t[6245] = "L'acte de contribuer au r\u00e9seau en permettant aux autres routeurs de construire des tunnels en utilisant votre routeur dans une cha\u00eene de tunnels. Au moins 12 Ko/s de largeur de bande montante (partage r\u00e9seau) doivent \u00eatre allou\u00e9s afin d'activer la participation. Notez que les routeurs derri\u00e8re un pare-feu seront limit\u00e9s dans leur contribution \u00e0 la participation, et un routeur d\u00e9sign\u00e9 comme Cach\u00e9 ne participera pas du tout.";
