    t[6377] = "Si le d\u00e9calage est sup\u00e9rieur \u00e0 quelques secondes, veuillez corriger le probl\u00e8me en r\u00e9glant l\u2019heure de votre ordinateur.";
    t[6382] = "Note: To enhance your security when browsing .i2p sites, you may wish to consider installing an addon to prevent Javascript from running in the browser such as <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, though it's recommended to whitelist the address I2P+ is running on to enable various router console enhancements. In addition, an addon that prevents requests to offsite resources is also recommended, for example <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
    t[6383] = "Note: Pour renforcer votre s\u00e9curit\u00e9 lors de la navigation sur des sites .i2p, vous pouvez envisager d'installer un addon pour emp\u00eacher l'ex\u00e9cution de Javascript dans le navigateur, comme <a href=https://addons.mozilla.org/fr/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, bien qu'il soit recommand\u00e9 d'autoriser l'adresse sur laquelle I2P+ est en cours d'ex\u00e9cution pour activer diverses am\u00e9liorations de la console du routeur. De plus, un addon emp\u00eachant les requ\u00eates vers des ressources externes est \u00e9galement recommand\u00e9, par exemple <a href=https://addons.mozilla.org/fr/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
