    t[6762] = "I2P+ may be slow to integrate into network the first time you run it as it bootstraps into the network and learns of additional peers. The longer your I2P+ router is running, the better it will perform, so try and keep your router on as long as you can, 24/7 if possible! If, after 30 minutes, your <i>Active: [connected/recent]</i> count still has less than 10 peers, or your total number of <i>Integrated</i> peers is less than 5, there are several things you can do to check for problems:";
    t[6763] = "I2P+ peut \u00eatre lent \u00e0 s'int\u00e9grer au r\u00e9seau la premi\u00e8re fois que vous l'ex\u00e9cutez car il s'amorce dans le r\u00e9seau et apprend l'existence de pairs suppl\u00e9mentaires. Plus longtemps votre routeur I2P+ est en marche, meilleures seront ses performances, essayez donc de le laisser allum\u00e9 aussi longtemps que possible, 24h/24 7j/7 si possible! Si, apr\u00e8s 30 minutes, votre compte <i>Actif : [connect\u00e9s/r\u00e9cents]</i> contient toujours moins de 10 pairs ou si votre nombre total de pairs <i>Int\u00e9gr\u00e9s</i> est inf\u00e9rieur \u00e0 5, plusieurs choses peuvent \u00eatre v\u00e9rifi\u00e9es pour d\u00e9tecter d'\u00e9ventuels probl\u00e8mes:";
