    t[6944] = "A java implementation of a Tor client, available as an I2P plugin. Can be used as the default <i>outproxy</i> if configured in the relevant SOCKS or HTTP client tunnel in the <i>Tunnel Manager</i>. Available from <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Source code is available on <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6945] = "Une impl\u00e9mentation Java d'un client Tor, disponible en tant que plugin I2P. Peut \u00eatre utilis\u00e9 comme <i>outproxy</i> par d\u00e9faut s'il est configur\u00e9 dans le tunnel SOCKS ou HTTP client appropri\u00e9 dans le <i>Gestionnaire de tunnels</i>. Disponible sur <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Le code source est disponible sur <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6952] = "IPv4 Addresses";
    t[6953] = "Adresses IPv4";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "Cette section indique vos vitesses de bande passante moyennes et votre utilisation totale pour la session. Toutes les valeurs sont en octets par seconde. Vous pouvez modifier vos limites de bande passante sur la page de <a href='/config'>configuration de bande passante</a>. Plus vous mettez de bande passante \u00e0 disposition, plus vous aidez le r\u00e9seau et am\u00e9liorez votre propre anonymat, alors prenez le temps de passer en revue les param\u00e8tres. Si vous n'\u00eates pas s\u00fbr de la vitesse de votre r\u00e9seau, utiliser un service tel que <a href='http://speedtest.net/'>SpeedTest</a> ou similaire vous donnera une bonne indication de votre capacit\u00e9 de bande passante. Votre montant de partage de bande passante en amont (KBps Sortant) d\u00e9terminera votre contribution globale au r\u00e9seau. La bande passante est <a href='/graphs'>graphique</a> par d\u00e9faut.";
