    t[7004] = "This setting allows you to configure the minimum number of hosted participating tunnels before the router starts to reject tunnel requests based on anticipated bandwidth requirements. [Default is 100 if system is running Android, 800 if system is running on ARM and less than 4 cores available, 1200 if system is running on ARM and 4 or more cores available, otherwise 2500]";
    t[7005] = "Ce param\u00e8tre vous permet de configurer le nombre minimum de tunnels participatifs h\u00e9berg\u00e9s avant que le routeur ne commence \u00e0 rejeter les demandes de tunnel en fonction des besoins de bande passante pr\u00e9vus. [La valeur par d\u00e9faut est de 100 si le syst\u00e8me fonctionne sous Android, 800 si le syst\u00e8me fonctionne sous ARM et moins de 4 c\u0153urs disponibles, 1200 si le syst\u00e8me fonctionne sous ARM et 4 c\u0153urs ou plus disponibles, sinon 2500]";
