    t[7022] = "This setting (in milliseconds) allows you to manually configure the queue delay target value for the CoDel queue management system. Default is 50ms. [Restart required]";
    t[7023] = "Ce param\u00e8tre (en millisecondes) vous permet de configurer manuellement la valeur cible de d\u00e9lai de file d'attente pour le syst\u00e8me de gestion de file d'attente CoDel. La valeur par d\u00e9faut est de 50ms. [Red\u00e9marrage requis]";
    t[7030] = "In order to maintain anonymity, it is recommended to update using the I2P http proxy. If the news or I2P update is hosted on I2P, using the proxy will be necessary.";
    t[7031] = "Afin de maintenir l'anonymat, il est recommand\u00e9 de mettre \u00e0 jour \u00e0 l'aide du proxy I2P HTTP. Si les nouvelles ou la mise \u00e0 jour I2P sont h\u00e9berg\u00e9es sur I2P, l'utilisation du proxy sera n\u00e9cessaire.";
