    t[7166] = "The I2P Client Protocol (I2CP) enables external applications (clients) to communicate with I2P over single TCP socket, by default using port 7654. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7167] = "Le protocole client I2P (I2CP) permet aux applications externes (clients) de communiquer avec I2P via une socket TCP unique, utilisant par d\u00e9faut le port 7654. Pour plus d'informations, consultez la <a href=https://geti2p.net/fr/docs/protocol/i2cp class='sitelink external' target=_blank rel=noreferrer>documentation en ligne</a>.";
    t[7168] = "Queue Totals";
    t[7169] = "Total de la file d'attente";
    t[7170] = "This setting determines which transport takes priority when communicating with peers. By default, NTCP is favored over UDP (SSU). By setting the value to true, UDP will be favored unless a pre-existing NTCP connection exists; when set to always, UDP will always be used regardless of any pre-existing NTCP connection. [Default is false]";
    t[7171] = "Ce param\u00e8tre d\u00e9termine quel transport est prioritaire lors de la communication avec les pairs. Par d\u00e9faut, le NTCP est privil\u00e9gi\u00e9 par rapport au UDP (SSU). En d\u00e9finissant la valeur sur true, le UDP sera privil\u00e9gi\u00e9 sauf s'il existe d\u00e9j\u00e0 une connexion NTCP ; lorsqu'il est d\u00e9fini sur always, le UDP sera toujours utilis\u00e9 quelles que soient les connexions NTCP pr\u00e9existantes. [La valeur par d\u00e9faut est false]";
