    t[7292] = "When set to true, I2P runs without network connectivity, which is helpful if you are constantly restarting the router to test code updates as this prevents network disruption.";
    t[7293] = "Lorsqu'il est d\u00e9fini sur true, I2P fonctionne sans connectivit\u00e9 r\u00e9seau, ce qui est pratique si vous red\u00e9marrez constamment le routeur pour tester des mises \u00e0 jour de code car cela emp\u00eache les perturbations r\u00e9seau.";
