    t[7308] = "SSU [IPv6 Only] with Introducers";
    t[7309] = "IPv6 seulement SSU, proposeurs";
    t[7312] = "SSU (Secure Semi-reliable UDP) is an I2P network transport providing encrypted, connection-oriented, point-to-point connections, in addition to IP address detection and NAT traversal services. For more information, see the <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7313] = "SSU (Secure Semi-reliable UDP) est un protocole de transport r\u00e9seau I2P fournissant des connexions chiffr\u00e9es, orient\u00e9es connexion et point \u00e0 point, en plus des services de d\u00e9tection d'adresse IP et de travers\u00e9e NAT. Pour plus d'informations, consultez la <a href=https://geti2p.net/fr/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>documentation en ligne</a>.";
    t[7314] = "Congestion window";
    t[7315] = "Fen\u00eatre d\u2019encombrement";
    t[7326] = "Use Proxy to Reseed";
    t[7327] = "Utiliser un proxy pour la d\u00e9clenche";
    t[7328] = "Until the advent of I2P integration in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, it wasn't possible to download torrents that weren't hosted on the I2P network. However, now that Vuze (and latterly <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) allow users to share non-I2P torrents on I2P, non-I2P torrents can be downloaded over I2P if Vuze/Bigly users have chosen to make content available to the I2P network. Popular torrents with a large number of peers are more likely to be accessible via I2P; to determine if the content is available, add the torrent link, magnet or infohash to your I2P-enabled BitTorrent client.";
    t[7329] = "Jusqu'\u00e0 l'int\u00e9gration d'I2P dans <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, il n'\u00e9tait pas possible de t\u00e9l\u00e9charger des torrents qui n'\u00e9taient pas h\u00e9berg\u00e9s sur le r\u00e9seau I2P. Cependant, maintenant que Vuze (et plus r\u00e9cemment <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) permettent aux utilisateurs de partager des torrents non-I2P sur I2P, les torrents non-I2P peuvent \u00eatre t\u00e9l\u00e9charg\u00e9s via I2P si les utilisateurs de Vuze/Bigly ont choisi de mettre le contenu \u00e0 la disposition du r\u00e9seau I2P. Les torrents populaires avec un grand nombre de pairs ont plus de chances d'\u00eatre accessibles via I2P; pour d\u00e9terminer si le contenu est disponible, ajoutez le lien du torrent, le magnet ou l'infohash \u00e0 votre client BitTorrent activ\u00e9 pour I2P.";
