    t[7428] = "This setting (in hours) determines how old a RouterInfo in the NetDb is (its last known publication date) before it's classified as stale and deleted. [Default is 28 hours unless the router is a Floodfill, in which case the default is 8 hours]";
    t[7429] = "Ce param\u00e8tre (en heures) d\u00e9termine l'\u00e2ge maximal d'un RouterInfo dans la NetDb (sa derni\u00e8re date de publication connue) avant qu'il ne soit class\u00e9 comme p\u00e9rim\u00e9 et supprim\u00e9. [La valeur par d\u00e9faut est de 28 heures, sauf pour les routeurs de type floodfill o\u00f9 la valeur par d\u00e9faut est de 8 heures.]";
