    t[7444] = "If a <i>Registration Authentication</i> string is requested, you can find it on the <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>Registration Authentication page</a> linked from the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. Registration authentication ensures only the owner is able to register or otherwise manage the hostname, and is required on stats.i2p and reg.i2p.";
    t[7445] = "Si une cha\u00eene d'<i>Authentification d'enregistrement</i> est demand\u00e9e, vous pouvez la trouver sur la page <a href='http://127.0.0.1:7657/i2ptunnel/register?tunnel=3'>d'authentification d'enregistrement</a> li\u00e9e depuis la page <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>de configuration du Gestionnaire de tunnels</a>. L'authentification d'enregistrement garantit que seul le propri\u00e9taire est en mesure d'enregistrer ou de g\u00e9rer autrement le nom de domaine, et est requise sur stats.i2p et reg.i2p.";
    t[7448] = "News &amp; Updates";
