    t[7452] = "[Linux/Unix/Solaris] If you can't start the router with <code>i2p/i2prouter start</code> try the <code>runplain.sh</code> script in the same directory. Root privileges are never required to run I2P+. If you need to compile the <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi library</a> (which is necessary in rare cases), consult the documentation, visit the forums, or visit <a href=irc://127.0.0.1:6668/saltR class=chatlink>the I2P+ channel</a> or <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>IRC developer channel</a>.";
    t[7453] = "[Linux/Unix/Solaris] Si vous ne pouvez pas d\u00e9marrer le routeur avec <code>i2p/i2prouter start</code> essayez le script <code>runplain.sh</code> dans le m\u00eame r\u00e9pertoire. Les privil\u00e8ges root ne sont jamais requis pour ex\u00e9cuter I2P+. Si vous devez compiler la biblioth\u00e8que <a href=http://i2p-projekt.i2p/jbigi.html target=_blank rel=noreferrer>jBigi</a> (ce qui est n\u00e9cessaire dans de rares cas), consultez la documentation, visitez les forums ou rendez-vous sur le canal <a href=irc://127.0.0.1:6668/saltR class=chatlink>I2P+</a> ou le canal de d\u00e9veloppement IRC <a href=irc://127.0.0.1:6668/i2p-dev class=chatlink>.</a>";
