    t[7459] = "Informations d\u00e9finissant l'identit\u00e9 unique d'un routeur sur le r\u00e9seau, comprenant son adresse IP (ou les adresses IP des introducers interm\u00e9diaires) et son port d'\u00e9coute, ses cl\u00e9s de signature et de chiffrement publiques. Les identit\u00e9s de routeur correspondent \u00e0 des pairs dans le NetDB. \u00c9galement appel\u00e9 <i>RouterInfo</i>.";
