    t[7690] = "A distributed database containing router contact information (RouterInfos) and destination contact information (LeaseSets). A single router maintains its own (partial) database for communicating with other routers on the network; no single router will maintain a list of all routers. The RouterInfos are stored on disk and read into memory when the router starts, or when new RouterInfos are acquired. Also referred to as the <i>NetDb</i>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7691] = "Une base de donn\u00e9es distribu\u00e9e contenant des informations de contact de routeur (RouterInfos) et de destination (LeaseSets). Un routeur unique maintient sa propre base de donn\u00e9es partielle pour communiquer avec les autres routeurs du r\u00e9seau ; aucun routeur unique ne maintiendra une liste de tous les routeurs. Les RouterInfos sont stock\u00e9es sur disque et lues en m\u00e9moire lorsque le routeur d\u00e9marre ou lorsque de nouveaux RouterInfos sont acquis. \u00c9galement appel\u00e9 <i>NetDb</i>. Pour plus d'informations, voir la <a href=https://geti2p.net/fr/docs/how/network-database class='sitelink external' target=_blank rel=noreferrer>documentation en ligne</a>.";
    t[7692] = "Address";
    t[7693] = "Adresse";
    t[7694] = "A threshold is defined by the number of connection attempts a remote destination is permitted to perform over a specified number of seconds before a \"breach\" occurs.";
    t[7695] = "Un seuil est d\u00e9fini par le nombre de tentatives de connexion qu'une destination distante est autoris\u00e9e \u00e0 effectuer sur un nombre sp\u00e9cifi\u00e9 de secondes avant qu'une \"violation\" ne se produise.";
    t[7704] = "Clearnet normally refers to the publicly accessible internet, the opposite of the darknet that typically describes the encrypted, anonymous services built on I2P, Tor etc. For more information, see the <a href=https://en.wikipedia.org/wiki/Clearnet_(networking) class='sitelink external' target=_blank rel=noreferrer>Wikipedia article</a>.";
    t[7705] = "Le r\u00e9seau classique d\u00e9signe normalement l'internet accessible au public, par opposition au darknet qui d\u00e9crit typiquement les services anonymes et crypt\u00e9s construits sur I2P, Tor, etc. Pour plus d'informations, voir l'<a href=https://en.wikipedia.org/wiki/R\u00e9seau_en_clair_(informatique) class='sitelink external' target=_blank rel=noreferrer>article Wikipedia</a>.";
