    t[7818] = "Defines the maximum number of parallel <a href=/jobs>jobs</a> that can be run. The default value is determined by the amount of memory allocated to the JVM via <code>wrapper.config</code>, and is set at 3 for less than 64MB, 4 for less than 256M, or 5 for more than 256MB. Note: A change to this setting requires a restart of the router.";
    t[7819] = "D\u00e9finit le nombre maximal de <a href=/jobs>t\u00e2ches</a> pouvant s'ex\u00e9cuter en parall\u00e8le. La valeur par d\u00e9faut est d\u00e9termin\u00e9e par la quantit\u00e9 de m\u00e9moire allou\u00e9e \u00e0 la JVM via <code>wrapper.config</code>, et est d\u00e9finie \u00e0 3 pour moins de 64 Mo, 4 pour moins de 256 Mo, ou 5 pour plus de 256 Mo. Remarque : un changement de ce param\u00e8tre n\u00e9cessite un red\u00e9marrage du routeur.";
