    t[7990] = "A router on the network tasked with providing and receiving information about other routers and services on the network. The current minimum share bandwidth for a router to be considered as capable of performing floodfill duties is 128 KBytes/sec, though it's possible to override this requirement and force a router to be a floodfill on the <a href=/configadvanced>Advanced Configuration page</a>. For more information, see the <a href=https://geti2p.net/en/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7991] = "Un routeur sur le r\u00e9seau charg\u00e9 de fournir et de recevoir des informations sur les autres routeurs et services du r\u00e9seau. Le d\u00e9bit de partage minimum actuel pour qu'un routeur soit consid\u00e9r\u00e9 comme capable d'assurer les fonctions de floodfill est de 128 Ko/s, bien qu'il soit possible de contourner cette exigence et de forcer un routeur \u00e0 \u00eatre un floodfill sur la <a href=/configadvanced>page de configuration avanc\u00e9e</a>. Pour plus d'informations, consultez la <a href=https://geti2p.net/fr/docs/how/network-database#floodfill class='sitelink external' target=_blank rel=noreferrer>documentation en ligne</a>.";
