    t[8208] = "Wherever possible, assets that are used repeatedly on your site should be loaded from an external file and not inlined. If you're using the same CSS on several pages, create a separate css file and load that in the <code>&lt;head&gt;</code> section of your pages. This will make styling updates to your site easier to manage, and will also allow the file to be cached in the visitor's browser, resulting in less bandwidth demands on your webserver and faster page loads for your visitors.";
    t[8209] = "Dans la mesure du possible, les \u00e9l\u00e9ments utilis\u00e9s de mani\u00e8re r\u00e9p\u00e9t\u00e9e sur votre site devraient \u00eatre charg\u00e9s \u00e0 partir d'un fichier externe et non incrust\u00e9s. Si vous utilisez le m\u00eame CSS sur plusieurs pages, cr\u00e9ez un fichier CSS distinct et chargez-le dans la section <code>&lt;head&gt;</code> de vos pages. Cela facilitera la gestion des mises \u00e0 jour de style sur votre site et permettra \u00e9galement au fichier d'\u00eatre mis en cache dans le navigateur du visiteur, ce qui r\u00e9duit les demandes de bande passante sur votre serveur web et acc\u00e9l\u00e8re le chargement des pages pour vos visiteurs.";
