    t[8256] = "Configuring I2P+: Network, Firefox, Tunnel Manager";
    t[8257] = "Configuration d'I2P : R\u00e9seau, Firefox, Tunnel Manager";
    t[8258] = "If you think you have opened up your firewall and I2P still thinks you are firewalled, remember that you may have multiple firewalls, for example both software packages and external hardware routers.";
    t[8259] = "Si vous pensez que vous avez ouvert votre pare-feu et qu\u2019I2P indique toujours que vous \u00eates derri\u00e8re un pare-feu, n\u2019oubliez pas que vous pourriez avoir plusieurs pare-feu, par exemple \u00e0 la fois des paquets logiciels et des routeurs mat\u00e9riels externes.";
    t[8270] = "The keyword <i class=example>deny</i>. This threshold is always breached, i.e. no connection attempts will be allowed.";
    t[8271] = "Le mot-cl\u00e9 <i class=example>deny</i>. Ce seuil est toujours viol\u00e9, c'est-\u00e0-dire qu'aucune tentative de connexion ne sera autoris\u00e9e.";
    t[8282] = "log visitors making 90 or more connections a minute";
    t[8283] = "consigner les visiteurs effectuant 90 connexions ou plus par minute";
    t[8286] = "You have configured inbound TCP, however your UDP port is firewalled, and therefore it is likely that your TCP port is firewalled as well.";
    t[8287] = "Vous avez configur\u00e9 le TCP entrant, cependant votre port UDP est derri\u00e8re un pare-feu et il est par cons\u00e9quent probable que votre port TCP le soit aussi.";
    t[8296] = "This is the number of peers your router will use for network database inquiries. These are usually the <i>floodfill</i> routers which are responsible for maintaining network integrity. Your well integrated peers are shown on the bottom of the <a href='/profiles'>Profiles page</a>.";
    t[8297] = "C'est le nombre de pairs que votre routeur utilisera pour les requ\u00eates \u00e0 la base de donn\u00e9es r\u00e9seau. Il s'agit g\u00e9n\u00e9ralement des routeurs <i>floodfill</i> responsables du maintien de l'int\u00e9grit\u00e9 du r\u00e9seau. Vos pairs bien int\u00e9gr\u00e9s sont affich\u00e9s en bas de la page <a href='/profiles'>Profils</a>";
    t[8298] = "Manage Router webapps";
    t[8299] = "G\u00e9rer les applications web de Router";
    t[8302] = "Outbound TCP from random high ports to arbitrary remote TCP ports.";
    t[8303] = "TCP sortant depuis des ports hauts al\u00e9atoires vers des ports TCP distants arbitraires.";
    t[8310] = "When you start I2P, it may take a few minutes to bootstrap (integrate) your router into the network and find additional peers, so please be patient.";
    t[8311] = "Quand vous d\u00e9marrez I2P, quelques minutes sont n\u00e9cessaires pour amorcer (int\u00e9grer) votre routeur dans le r\u00e9seau et trouver des pairs suppl\u00e9mentaires. Veuillez donc faire preuve de patience.";
    t[8318] = "No file specified. Please select a valid .zip or .su3 file to reseed from.";
    t[8319] = "Aucun fichier sp\u00e9cifi\u00e9. Veuillez s\u00e9lectionner un fichier .zip ou .su3 valide \u00e0 partir de la r\u00e9vision.";
    t[8320] = "Enable Universal Plug and Play (UPnP)";
