    t[8323] = "Page Assistant inconnu";
    t[8326] = "NTCP &amp; SSU with Introducers [IPv6 Only]";
    t[8327] = "IPv6 seulement NTCP, SSU, proposeurs";
    t[8332] = "Messages sent to peer";
    t[8333] = "Messages envoy\u00e9s \u00e0 l'homologue";
    t[8334] = "Function";
    t[8335] = "Fonction";
    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "Sur le r\u00e9seau I2P, les services h\u00e9berg\u00e9s \u00e0 distance peuvent \u00eatre accessibles en utilisant une adresse <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> se terminant par \".b32.i2p\", une <i>destination</i> repr\u00e9sent\u00e9e par une longue cha\u00eene <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a>, ou plus g\u00e9n\u00e9ralement en utilisant un domaine .i2p. Une destination est l'\u00e9quivalent d'I2P d'une adresse IP, et est affich\u00e9e sur la page de configuration du <a href='/i2ptunnel/edit?tunnel=3'>Gestionnaire de tunnels</a>. Vous pouvez partager votre adresse b32.i2p pour permettre aux autres d'acc\u00e9der \u00e0 votre site web jusqu'\u00e0 ce que vous ayez enregistr\u00e9 votre propre domaine .i2p.";
