    t[8350] = "Enter the name and paste the destination into your <a href='/dns?book=router&amp;filter=none'>address book</a>. Click <i>Add</i> to save the new entry.";
    t[8351] = "Indiquez le nom et collez la destination dans votre <a href='/dns?book=router&amp;filter=none'>carnet d'adresses</a>. Cliquez sur <i>Ajouter</i> pour enregistrer la nouvelle entr\u00e9e.";
    t[8358] = "Stats";
