    t[8361] = "Nombre maximum de messages simultan\u00e9s \u00e0 envoyer";
    t[8364] = "Recorders keep track of connection attempts made by a remote destination, and if that breaches the defined threshold, the destination gets logged in the specified file. Multiple recorders can be specified:";
    t[8365] = "Les enregistreurs gardent la trace des tentatives de connexion effectu\u00e9es par une destination distante, et si celle-ci d\u00e9passe le seuil d\u00e9fini, la destination est consign\u00e9e dans le fichier sp\u00e9cifi\u00e9. Plusieurs enregistreurs peuvent \u00eatre sp\u00e9cifi\u00e9s:";
