    t[8410] = "To disable directory listings, find the entry for <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> in the <code>base-context.xml</code> file, located in the <code>eepsite/contexts</code> folder (just above docroot folder), and change 'true' to 'false' immediately underneath. To apply the change immediately, stop and restart the <i>I2P Webserver</i> client on the <a href=/configclients>Client Configuration page</a>. You can also drop an empty <code>index.html</code> file in any exposed directory to suppress directory listings for that location.";
    t[8411] = "Pour d\u00e9sactiver les listes de r\u00e9pertoires, recherchez l'entr\u00e9e pour <code>org.eclipse.jetty.servlet.Default.dirAllowed</code> dans le fichier <code>base-context.xml</code>, situ\u00e9 dans le r\u00e9pertoire <code>eepsite/contexts</code> (juste au-dessus du r\u00e9pertoire docroot), et modifiez 'true' en 'false' imm\u00e9diatement en-dessous. Pour appliquer le changement imm\u00e9diatement, arr\u00eatez et red\u00e9marrez le client <i>Serveur Web I2P</i> sur la page de <a href=/configclients>configuration des clients</a>. Vous pouvez \u00e9galement d\u00e9poser un fichier vide <code>index.html</code> dans tout r\u00e9pertoire expos\u00e9 pour supprimer les listes de r\u00e9pertoires \u00e0 cet endroit.";
