    t[8554] = "If you're not using IE, it's likely that your browser is pretending to be IE; please configure your browser (or proxy) to use a different User Agent string if you'd like to access the console themes.";
    t[8555] = "Si vous n\u2019utilisez pas IE, il est probable que votre navigateur pr\u00e9tend \u00eatre IE. Veuillez configurer votre navigateur (ou mandataire) pour qu\u2019il utilise une cha\u00eene diff\u00e9rente d\u2019agent utilisateur si vous souhaitez acc\u00e9der aux th\u00e8mes de la console.";
    t[8564] = "Privacy-focused Clearnet Search Engine";
    t[8565] = "Moteur de recherche Clearnet ax\u00e9 sur la confidentialit\u00e9";
    t[8572] = "<a href=/logs>Logs</a> may help resolve a problem. You may wish to paste excerpts in a <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> for help, or perhaps <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>paste</a> it instead and reference the link on IRC for help.";
    t[8573] = "Les <a href=/logs>journaux</a> peuvent aider \u00e0 r\u00e9soudre un probl\u00e8me. Vous souhaiterez peut-\u00eatre coller des extraits dans un <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> pour obtenir de l'aide, ou peut-\u00eatre <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>coller</a> \u00e0 la place et r\u00e9f\u00e9rencer le lien sur IRC pour obtenir de l'aide.";
    t[8574] = "Plugins signed with the cryptographic key of the developer are the recommended format, but if you wish to install unsigned plugins (.zip) you can set this to true. Note that you may still encounter issues attempting to install an unsigned plugin if the developer has included additional checks in the plugin build process.";
    t[8575] = "Les plugins sign\u00e9s avec la cl\u00e9 cryptographique du d\u00e9veloppeur sont le format recommand\u00e9, mais si vous souhaitez installer des plugins non sign\u00e9s (.zip), vous pouvez d\u00e9finir cette option sur true. Notez que vous pouvez toujours rencontrer des probl\u00e8mes lors de la tentative d'installation d'un plugin non sign\u00e9 si le d\u00e9veloppeur a inclus des contr\u00f4les suppl\u00e9mentaires dans le processus de construction du plugin.";
    t[8578] = "If you are running a standalone Tor instance locally, you may use it by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8579] = "Si vous utilisez une instance Tor autonome localement, vous pouvez l'utiliser en configurant I2P pour utiliser : <i>Type de proxy :</i> <code>SOCKS 5</code> <i>H\u00f4te :</i> <code>127.0.0.1</code> <i>Port :</i> <code>9050</code>.";
    t[8584] = "Select the language to be used for the router console and web applications (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnel manager</a> etc). If you wish to change the language in future, change the router console theme, or configure a password to access the console, you may do so on the <a href=/configui target=_blank rel=noreferrer>User Interface configuration page</a>.";
    t[8585] = "Choisissez la langue \u00e0 utiliser pour la console du routeur et les applications web (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>gestionnaire de tunnels</a> etc). Si vous souhaitez modifier la langue ult\u00e9rieurement, modifier le th\u00e8me de la console du routeur ou configurer un mot de passe pour acc\u00e9der \u00e0 la console, vous pourrez le faire sur la page de configuration de l'<a href=/configui target=_blank rel=noreferrer>Interface utilisateur</a>.";
