    t[9052] = "Ready";
    t[9053] = "Pr\u00eat";
    t[9056] = "These are the local services provided by your router. They may be clients started through the <a href='/i2ptunnelmgr'>Tunnel Manager</a> or external programs connecting through SAM, BOB, or directly to I2CP. By default, most of your client services (mail, http proxy, IRC) will share the same set of tunnels and be listed as <i>Shared Clients</i> and <i>Shared Clients(DSA)</i>, which enhances anonymity by blending the traffic from all shared services, and reduces the overhead required to build and maintain tunnels. However, if you experience a tunnel failure, all your services will go offline at the same time, so in some scenarios you may wish to configure client services to use their own set of tunnels. This can be done by unchecking the <i>Share tunnels with other clients&hellip;</i> option listed under <i>Shared Clients</i> on the configuration page of the relevant client service in the Tunnel Manager, after which you will need to restart the client service from the <a href='/i2ptunnelmgr'>main Tunnel Manager page</a>.";
    t[9057] = "Ce sont les services locaux fournis par votre routeur. Ils peuvent \u00eatre des clients d\u00e9marr\u00e9s via le <a href='/i2ptunnelmgr'>Gestionnaire de tunnels</a> ou des programmes externes se connectant via SAM, BOB ou directement \u00e0 I2CP. Par d\u00e9faut, la plupart de vos services clients (courrier, proxy HTTP, IRC) partageront le m\u00eame ensemble de tunnels et seront list\u00e9s sous <i>Clients partag\u00e9s</i> et <i>Clients partag\u00e9s(DSA)</i>, ce qui am\u00e9liore l'anonymat en m\u00e9langeant le trafic de tous les services partag\u00e9s, et r\u00e9duit la charge requise pour construire et maintenir les tunnels. Cependant, si vous rencontrez une d\u00e9faillance de tunnel, tous vos services seront d\u00e9connect\u00e9s en m\u00eame temps, donc dans certains sc\u00e9narios vous souhaiterez peut-\u00eatre configurer les services clients pour qu'ils utilisent leur propre ensemble de tunnels. Cela peut se faire en d\u00e9cochant l'option <i>Partager les tunnels avec d'autres clients&hellip;</i> r\u00e9pertori\u00e9e sous  <i>Clients partag\u00e9s</i> sur la page de configuration du service client correspondant dans le Gestionnaire de tunnels, apr\u00e8s quoi vous devrez red\u00e9marrer le service client \u00e0 partir de la <a href='/i2ptunnelmgr'>page principale du Gestionnaire de tunnels</a>.";
