    t[9240] = "A simple CGI application that takes a hostname as a parameter and returns a 301 redirect to the proper URL with a <code>?i2paddresshelper=key</code> string appended. The HTTP proxy will interpret the appended string and use the key as the actual destination. In addition, the proxy will cache the key so the address helper is not necessary until restart, and offer the option to add the resolved address to the addressbook.";
    t[9241] = "Une simple application CGI qui prend un nom de domaine en param\u00e8tre et renvoie une redirection 301 vers l'URL appropri\u00e9e avec la cha\u00eene <code>?i2paddresshelper=key</code> ajout\u00e9e. Le proxy HTTP interpr\u00e9tera la cha\u00eene ajout\u00e9e et utilisera la cl\u00e9 comme destination r\u00e9elle. De plus, le proxy mettra en cache la cl\u00e9 de sorte que l'assistant d'adresse ne soit plus n\u00e9cessaire jusqu'au red\u00e9marrage, et proposera l'option d'ajouter l'adresse r\u00e9solue au carnet d'adresses.";
