    t[9292] = "This setting (in minutes) allows you to manually configure how long to wait after startup before RouterInfos in the NetDb are checked for validity, after which point only valid routers will be accepted for inclusion. When the validation occurs, expired RouterInfos and unresponsive peers only accessible via SSU will be removed from the NetDb. [Default is 60 minutes] Note: This setting has no bearing on older routers (older than 0.9.29 by default) which are removed from the NetDb and banned for the router session as soon as a NetDb store is attempted.";
    t[9293] = "Ce param\u00e8tre (en minutes) vous permet de configurer manuellement la dur\u00e9e d'attente apr\u00e8s le d\u00e9marrage avant de v\u00e9rifier la validit\u00e9 des RouterInfos dans la NetDb, apr\u00e8s quoi seuls les routeurs valides seront accept\u00e9s pour inclusion. Lors de la validation, les RouterInfos expir\u00e9s et les pairs non r\u00e9actifs uniquement accessibles via SSU seront supprim\u00e9s de la NetDb. [La valeur par d\u00e9faut est de 60 minutes] Remarque : ce param\u00e8tre n'a aucune incidence sur les routeurs plus anciens (ant\u00e9rieurs \u00e0 0.9.29 par d\u00e9faut) qui sont supprim\u00e9s de la NetDb et bannis pour la session du routeur d\u00e8s qu'un enregistrement NetDb est tent\u00e9.";
