    t[9326] = "The router's external port allows communication with other routers. It is recommended to configure your firewall to allow inbound and outbound traffic on this port to optimize your router's performance on the network.";
    t[9327] = "Le port externe du routeur permet de communiquer avec d'autres routeurs. Il est recommand\u00e9 de configurer votre pare-feu pour autoriser le trafic entrant et sortant sur ce port afin d'optimiser les performances de votre routeur sur le r\u00e9seau.";
