    t[9354] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining. The default settings will work for most people. Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[9355] = "Le d\u00e9clenchement est le processus de d\u00e9marrage utilis\u00e9 pour trouver d'autres routeurs lors de l'installation initiale d'I2P ou lorsque votre routeur ne dispose plus de suffisamment de r\u00e9f\u00e9rences vers d'autres routeurs. Les param\u00e8tres par d\u00e9faut conviendront \u00e0 la plupart des gens. Ne les modifiez que si HTTPS est bloqu\u00e9 par un pare-feu restrictif et que le d\u00e9clenchement a \u00e9chou\u00e9.";
    t[9362] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
    t[9363] = "Ce param\u00e8tre, lorsqu'il est activ\u00e9, modifie le d\u00e9lai al\u00e9atoire maximal de pong introduit pour les serveurs activ\u00e9s par ping, si <code>i2p.streaming.enablePongDelay</code> est \u00e9galement activ\u00e9. Si aucune valeur n'est d\u00e9finie explicitement, la valeur par d\u00e9faut de 50ms sera utilis\u00e9e.";
