    t[9466] = "This may be a transient error, if the other program is no longer using the port.";
    t[9467] = "Il s\u2019agit peut-\u00eatre d\u2019une erreur erreur passag\u00e8re temporaire, si l\u2019autre programme n\u2019utilise plus le port.";
    t[9474] = "Your I2P+ router by default contributes to the network by routing internal, end-to-end encrypted traffic for other routers, known as <i>participation</i>. Bandwidth participation improves the anonymity level of all users on the network and maximizes your download speed.";
    t[9475] = "Par d\u00e9faut, votre routeur I2P+ contribue au r\u00e9seau en acheminant le trafic interne crypt\u00e9 de bout en bout pour d'autres routeurs, appel\u00e9 <i>participation</i>. La participation \u00e0 la bande passante am\u00e9liore le niveau d'anonymat de tous les utilisateurs du r\u00e9seau et maximise votre vitesse de t\u00e9l\u00e9chargement.";
    t[9476] = "This setting permits the configuration of alternative NTP servers required to ensure that your router maintains accurate clock time. [Default is 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9477] = "Ce param\u00e8tre permet de configurer des serveurs NTP de substitution n\u00e9cessaires pour garantir que votre routeur maintient une heure pr\u00e9cise. [La valeur par d\u00e9faut est 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9484] = "Optimize your images";
    t[9485] = "Optimisez vos images";
    t[9488] = "Note that the profiler relies on sustained client tunnel usage to accurately profile peers.";
    t[9489] = "Notez que le profileur s'appuie sur une utilisation soutenue du tunnel client pour profiler avec pr\u00e9cision ses pairs.";
    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "Si vous \u00eates press\u00e9 et ne pouvez pas attendre quelques heures, vous pouvez dire aux gens d'utiliser un service de redirection d'adresse assistant de \u00ab saute \u00bb. Cela fonctionnera g\u00e9n\u00e9ralement quelques minutes apr\u00e8s l'enregistrement de votre nom de domaine sur le m\u00eame site. Testez-le d'abord vous-m\u00eame en entrant <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>votrenomde domaines\u00e9lectionn\u00e9.i2p</i></code> dans votre navigateur. Une fois que \u00e7a fonctionne, vous pouvez dire aux autres de l'utiliser.";
