    t[9580] = "Note that the full path to the output files must be accessible before deploying the filter. If the target directory does not exist, the destinations will not be recorded and an error will appear in the router logs. The files will be created as required. The examples provided above are not recommendations; your configuration should be tuned according to the amount of content (number and size of files) your site is serving, the speed of the server, and the frequency with which the site is updated. Configuring recorders and monitoring the resulting files will help you fine tune the settings.";
    t[9581] = "Notez que le chemin d'acc\u00e8s complet aux fichiers de sortie doit \u00eatre accessible avant le d\u00e9ploiement du filtre. Si le r\u00e9pertoire cible n'existe pas, les destinations ne seront pas enregistr\u00e9es et une erreur apparaitra dans les journaux du routeur. Les fichiers seront cr\u00e9\u00e9s selon les besoins. Les exemples fournis ci-dessus ne constituent pas des recommandations&#59; votre configuration doit \u00eatre ajust\u00e9e en fonction du volume de contenu (nombre et taille des fichiers) servi par votre site, de la vitesse du serveur et de la fr\u00e9quence de mise \u00e0 jour du site. La configuration d'enregistreurs et le suivi des fichiers r\u00e9sultants vous aideront \u00e0 affiner les param\u00e8tres.";
    t[9588] = "In the Network Settings sub-section, hit the <i>Settings</i> button.";
