    t[9630] = "Tunnels built by other routers through your router. This may vary widely depending on network demand, your shared bandwidth, and amount of locally-generated traffic. The recommended method for limiting participating tunnels is to change your share percentage on the <a  href='/config'>Bandwidth Configuration page</a>. You may also limit the total number by setting <code>router.maxParticipatingTunnels=nnn</code> on the <a href='/configadvanced'>Advanced configuration page</a>. <a href='/configstats#tunnel.participatingTunnels'>[Enable graphing]</a>.";
    t[9631] = "Tunnels construits par d'autres routeurs via votre routeur. Cela peut varier grandement selon la demande du r\u00e9seau, votre bande passante partag\u00e9e et le volume de trafic g\u00e9n\u00e9r\u00e9 localement. La m\u00e9thode recommand\u00e9e pour limiter les tunnels de participation consiste \u00e0 modifier votre pourcentage de partage sur la page de <a href='/config'>configuration de bande passante</a>. Vous pouvez \u00e9galement limiter le nombre total en d\u00e9finissant <code>router.maxParticipatingTunnels=nnn</code> sur la page de <a href='/configadvanced'>configuration avanc\u00e9e</a>. <a href='/configstats#tunnel.participatingTunnels'>[Activer le graphique]</a>.";
