    t[10038] = "To configure an alternative webserver for use on I2P, you can either use the existing webserver tunnel and <a href=/configclients>disable the default webserver</a> from running, or create a new HTTP Server tunnel in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Ensure that the webserver's <i>listening port</i> is also configured in the Tunnel Manager settings. For example, if your webserver is listening by default on address 127.0.0.1 port 80, you'd also need to ensure that the <i>Target port</i> in the Tunnel Manager settings page for the service is also configured to port 80.";
    t[10039] = "Pour configurer un serveur Web alternatif pour une utilisation sur I2P, vous pouvez soit utiliser le tunnel de serveur Web existant et <a href=/configclients>d\u00e9sactiver le serveur Web par d\u00e9faut</a> de l'ex\u00e9cution, soit cr\u00e9er un nouveau tunnel Serveur HTTP dans le <a href=/i2ptunnelmgr>Gestionnaire de tunnels</a>. Assurez-vous \u00e9galement que le <i>port d'\u00e9coute</i> du serveur Web est configur\u00e9 dans les param\u00e8tres du Gestionnaire de tunnels. Par exemple, si votre serveur Web \u00e9coute par d\u00e9faut sur l'adresse 127.0.0.1 port 80, vous devrez \u00e9galement vous assurer que le <i>port cible</i> dans la page de param\u00e9trage du service du Gestionnaire de tunnels est \u00e9galement configur\u00e9 sur le port 80.";
