    t[10046] = "An I2P router usually only needs to be seeded once, to join the network for the first time. However, if the router is running for an extended period without network connectivity it may also need to be reseeded. Reseeding involves fetching multiple \"RouterInfo\" files (bundled into a signed zip-file) from at least two predefined server URLs picked from a volunteer-run group of clearnet HTTPS servers.";
    t[10047] = "Un routeur I2P a g\u00e9n\u00e9ralement besoin d'\u00eatre ensemenc\u00e9 une seule fois pour rejoindre le r\u00e9seau pour la premi\u00e8re fois. Cependant, si le routeur fonctionne pendant une p\u00e9riode prolong\u00e9e sans connectivit\u00e9 r\u00e9seau, il peut \u00e9galement avoir besoin d'\u00eatre r\u00e9ensemenc\u00e9. Le r\u00e9ensemencement consiste \u00e0 r\u00e9cup\u00e9rer plusieurs fichiers \u00ab RouterInfo \u00bb (regroup\u00e9s dans un fichier zip sign\u00e9) \u00e0 partir d'au moins deux adresses serveur pr\u00e9d\u00e9finies choisies parmi un groupe de serveurs HTTPS du clearnet g\u00e9r\u00e9 par des b\u00e9n\u00e9voles.";
