    t[10076] = "A list of countries derived from the <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> with a poor civil liberties reputation. This list is used to place routers running in the specified countries in <i>Hidden Mode</i> to provide enhanced security for users. The following countries are designated as strict: Afghanistan, Azerbaijan, Bahrain, Belarus, Brunei, Burundi, Cameroon, Central African Republic, Chad, China, Cuba, Democratic Republic of the Congo, Egypt, Equatorial Guinea, Eritrea, Ethiopia, Iran, Kazakhstan, Laos, Libya, Myanmar, North Korea, Palestinian Territories, Rwanda, Saudi Arabia, Somalia, South Sudan, Sudan, Eswatini (Swaziland), Syria, Tajikistan, Thailand, Turkey, Turkmenistan, Venezuela, United Arab Emirates, Uzbekistan, Western Sahara, Yemen.";
    t[10077] = "Une liste de pays d\u00e9riv\u00e9e du <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> ayant une mauvaise r\u00e9putation en mati\u00e8re de libert\u00e9s civiles. Cette liste sert \u00e0 placer les routeurs fonctionnant dans les pays sp\u00e9cifi\u00e9s en <i>mode cach\u00e9</i> pour offrir une s\u00e9curit\u00e9 accrue aux utilisateurs. Les pays suivants sont d\u00e9sign\u00e9s comme stricts: Afghanistan, Azerba\u00efdjan, Bahre\u00efn, B\u00e9larus, Brunei, Burundi, Cameroun, R\u00e9publique centrafricaine, Tchad, Chine, Cuba, R\u00e9publique d\u00e9mocratique du Congo, Egypte, Guin\u00e9e \u00e9quatoriale, Erythr\u00e9e, Ethiopie, Iran, Kazakhstan, Laos, Libye, Birmanie, Cor\u00e9e du Nord, Territoires palestiniens, Rwanda, Arabie saoudite, Somalie, Soudan du Sud, Soudan, Eswatini (Swaziland), Syrie, Tadjikistan, Tha\u00eflande, Turquie, Turkm\u00e9nistan, Venezuela, Emirats arabes unis, Ouzb\u00e9kistan, Sahara occidental, Y\u00e9men.";
