    t[10294] = "A limited selection of stats is enabled by default, required for monitoring router performance. Only stats that have an optional graph are listed here; for a full list of enabled stats, view the <a href=\"/stats\">stats page</a>.";
    t[10295] = "Une s\u00e9lection limit\u00e9e de statistiques est activ\u00e9e par d\u00e9faut, requise pour surveiller les performances du routeur. Seules les statistiques qui ont un graphique facultatif sont r\u00e9pertori\u00e9es ici; Pour une liste compl\u00e8te des statistiques activ\u00e9es, consultez la page <a href=/stats>page de statistiques</a>.";
