    t[10306] = "Once green stars are indicated next to your Local Tunnels, there is a wide variety of things you can do with I2P.";
    t[10307] = "Une fois que des \u00e9toiles vertes apparaissent \u00e0 c\u00f4t\u00e9 de vos tunnels locaux, un large \u00e9ventail de choses \u00e0 faire avec I2P s\u2019offre \u00e0 vous.";
    t[10312] = "Please wait for routing commitment to expire for {0} tunnel";
    t[10313] = new java.lang.String[] { "Veuillez attendre que les engagements de routage de {0} tunnel arrivent \u00e0 expiration", "Veuillez attendre que les engagements de routage de {0} tunnels arrivent \u00e0 expiration" };
    t[10318] = "Where possible, please ensure I2P+/Java is allowed bi-directional port access from the internet by configuring your modem/router/pc firewall accordingly. If you're behind a prohibitive firewall but have unrestricted outbound access, I2P+ can still function; you can turn off inbound access and rely on <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP Address Detection</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall hole punching</a>) to connect you to the network, and your network status in the side panel will indicate \"Status: Firewalled\". For optimal performance, please ensure I2P's <a href=/confignet#udpconfig>external port</a> is visible from the internet (see below for more information).";
    t[10319] = "Dans la mesure du possible, assurez-vous que I2P+/Java autorise l'acc\u00e8s bidirectionnel aux ports depuis Internet en configurant votre modem/routeur/pare-feu d'ordinateur en cons\u00e9quence. Si vous \u00eates derri\u00e8re un pare-feu prohibitif mais que vous disposez d'un acc\u00e8s sortant non restreint, I2P+ pourra toujours fonctionner ; vous pouvez d\u00e9sactiver l'acc\u00e8s entrant et vous appuyer sur <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>la d\u00e9tection d'adresses IP SSU</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>pare-feu par per\u00e7age de trous</a>) pour vous connecter au r\u00e9seau, et l'\u00e9tat de votre r\u00e9seau dans le volet lat\u00e9ral indiquera \u00ab \u00c9tat : Pare-feu \u00bb. Pour des performances optimales, assurez-vous que le <a href=/confignet#udpconfig>port externe</a> d'I2P est visible depuis Internet (voir ci-dessous pour plus de d\u00e9tails).";
