    t[10651] = "Paquets en double re\u00e7us de l'homologue";
    t[10660] = "Services may be hosted on multiple routers simultaneously, by sharing the same private key for the destination. Multihoming can further enhance the security and stability of a server by providing redundancy; if a server is multihomed, when a server in the pool goes offline, the provided service will remain available, making it more difficult to correlate server downtime with a router going offline.";
    t[10661] = "Les services peuvent \u00eatre h\u00e9berg\u00e9s sur plusieurs routeurs simultan\u00e9ment, en partageant la m\u00eame cl\u00e9 priv\u00e9e pour la destination. Le multihoming peut encore am\u00e9liorer la s\u00e9curit\u00e9 et la stabilit\u00e9 d'un serveur en fournissant de la redondance ; si un serveur est multi-h\u00e9berg\u00e9, lorsqu'un serveur du pool devient indisponible, le service fourni restera disponible, ce qui rend plus difficile la corr\u00e9lation entre l'indisponibilit\u00e9 d'un serveur et la mise hors ligne d'un routeur.";
