    t[11024] = "By default, I2P will use the system configured default browser to launch at startup. If you wish to nominate an alternative browser, you will need to edit your router.config file (or the <a href=/configadvanced>Advanced Configuration page</a> if you have enabled advanced console mode) and add a new configuration line <code>routerconsole.browser=/path/to/browser</code> or <code>routerconsole.browser=\\path\\to\\browser.exe</code> if using Windows, replacing <code>\\path\\to\\browser</code> with the location of the browser you wish to use. Note: If the path to your chosen browser contains spaces, you may need to encase the path in quotes e.g. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
    t[11025] = "Par d\u00e9faut, I2P utilisera le navigateur par d\u00e9faut configur\u00e9 dans le syst\u00e8me au d\u00e9marrage. Si vous souhaitez d\u00e9signer un navigateur alternatif, vous devrez modifier votre fichier router.config (ou la page <a href=/configadvanced>Configuration avanc\u00e9e</a> si vous avez activ\u00e9 le mode console avanc\u00e9) et ajouter une nouvelle ligne de configuration <code>routerconsole.browser=/chemin/vers/navigateur</code> ou <code>routerconsole.browser=\\chemin\\vers\\navigateur.exe</code> si vous utilisez Windows, en rempla\u00e7ant <code>\\chemin\\vers\\navigateur</code> par l'emplacement du navigateur que vous souhaitez utiliser. Remarque: si le chemin vers votre navigateur choisi contient des espaces, il peut s'av\u00e9rer n\u00e9cessaire d'entourer le chemin de guillemets, par exemple <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
