    t[11106] = "This setting (in hours) allows you to manually configure how old a RouterInfo is in order for it to be checked by the Refresh Routers Job. By default, the age of a RouterInfo before a refresh is intitiated scales according to the size of the NetDb, increasing as the NetDb grows in size. A value of 0 will force the Router Refresh Job to check every router in the NetDb, regardless of age.";
    t[11107] = "Ce param\u00e8tre (en heures) vous permet de configurer manuellement l'\u00e2ge maximal qu'un RouterInfo doit atteindre pour \u00eatre v\u00e9rifi\u00e9 par la t\u00e2che Refresh Routers Job. Par d\u00e9faut, l'\u00e2ge d'un RouterInfo avant son rafra\u00eechissement s'adapte en fonction de la taille de la NetDb, augmentant au fur et \u00e0 mesure que la taille de la NetDb s'accro\u00eet. Une valeur de 0 forcera la t\u00e2che Refresh Routers Job \u00e0 v\u00e9rifier chaque routeur dans la NetDb, quel que soit leur \u00e2ge.";
