    t[11128] = "An I2P web application that manages service destinations for the network, mapping B64 hashes to human-readable names. Destinations may be added manually, or via subscriptions to hosts.txt files. Also referred to as SusiDNS. For more information, see the <a href=https://geti2p.net/en/docs/naming class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[11129] = "Une application Web I2P qui g\u00e8re les destinations de service pour le r\u00e9seau, mappant les hachages B64 \u00e0 des noms lisibles par l'homme. Les destinations peuvent \u00eatre ajout\u00e9es manuellement ou via des abonnements \u00e0 des fichiers hosts.txt. \u00c9galement appel\u00e9 SusiDNS. Pour plus d'informations, voir la <a href=https://geti2p.net/fr/docs/naming class='sitelink external' target=_blank rel=noreferrer>documentation en ligne</a>.";
    t[11130] = "Events per period";
