    t[11150] = "A tunnel to the main IRC server network within I2P, Irc2P, is created when I2P is installed (see the <a href=/i2ptunnelmgr>Tunnel Manager</a>), and is automatically started when the I2P router starts. To connect to it, tell your IRC client to connect to server: <code>127.0.0.1</code> port: <code>6668</code>.";
    t[11151] = "Un tunnel vers le r\u00e9seau principal du serveur IRC dans I2P, Irc2P, est cr\u00e9\u00e9 lors de l'installation d'I2P (voir le <a href=/i2ptunnelmgr>Gestionnaire de tunnels</a>), et est automatiquement d\u00e9marr\u00e9 lorsque le routeur I2P d\u00e9marre. Pour vous y connecter, indiquez \u00e0 votre client IRC de se connecter au serveur : <code>127.0.0.1</code> port : <code>6668</code>.";
