    t[11230] = "Can be enabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces. If both http and https are enabled, automatic redirection to https is enabled by default. If you make the Router Console available over the network, you might wish to <a href=/configui#passwordheading>enforce an access password</a> to prevent unauthorized access.";
    t[11231] = "Peut \u00eatre activ\u00e9 dans le fichier <code>clients.config</code>. Peut \u00e9galement \u00eatre configur\u00e9 pour se lier \u00e0 une interface sp\u00e9cifique ou \u00e0 toutes les interfaces. Si http et https sont tous les deux activ\u00e9s, la redirection automatique vers https est activ\u00e9e par d\u00e9faut. Si vous rendez la Console du Routeur disponible sur le r\u00e9seau, vous souhaiterez peut-\u00eatre <a href=/configui#passwordheading>imposer un mot de passe d'acc\u00e8s</a> pour emp\u00eacher les acc\u00e8s non autoris\u00e9s.";
