    t[11516] = "In order to use a single set of tunnels for multiple client services, clients can be configured from the <i>Tunnel Manager</i> to operate in <i>Shared Client</i> mode. This mode conserves resources and blends the traffic from multiple clients into a single set of tunnels, making traffic analysis harder. Clients configured as Shared Clients share the same tunnel options.";
    t[11517] = "Afin d'utiliser un seul jeu de tunnels pour plusieurs services client, les clients peuvent \u00eatre configur\u00e9s \u00e0 partir du <i>Gestionnaire de tunnels</i> pour fonctionner en mode <i>Client partag\u00e9</i>. Ce mode permet de pr\u00e9server les ressources et de m\u00e9langer le trafic de plusieurs clients dans un seul jeu de tunnels, ce qui rend l'analyse du trafic plus difficile. Les clients configur\u00e9s en tant que clients partag\u00e9s partagent les m\u00eames options de tunnel.";
