    t[11658] = "Your modem or router may support <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), which permits automatic port forwarding. Ensure UPnP support for I2P+ is enabled on the <a href=/confignet>config page</a>, then try to activate UPnP on your modem/router and possibly your computer also. Now try restarting the <a href=/>I2P+ router</a>. If successful, I2P+ should report \"Status: OK\" in the side panel once the I2P+ router completes initial connectivity tests.";
    t[11659] = "Votre modem ou routeur peut supporter le <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>protocole Universal Plug & Play</a> (UPnP), qui permet le transfert de ports automatique. Assurez-vous que le support UPnP pour I2P+ est activ\u00e9 dans la page de <a href=/confignet>configuration</a>, puis essayez d'activer l'UPnP sur votre modem/routeur et \u00e9ventuellement aussi sur votre ordinateur. R\u00e9essayez maintenant de red\u00e9marrer le <a href=/>routeur I2P+</a>. Si cela r\u00e9ussit, I2P+ devrait afficher \"Status: OK\" dans le panneau lat\u00e9ral une fois les tests de connectivit\u00e9 initiale du routeur I2P+ termin\u00e9s.";
