    t[11963] = "Les pairs marqu\u00e9s comme ayant une capacit\u00e9 \u00e9lev\u00e9e qui atteignent ou d\u00e9passent \u00e9galement la vitesse moyenne pour tous les pairs profil\u00e9s.";
    t[11964] = "Local connection to wrapper control channel port";
    t[11965] = "Connexion locale au port du canal de contr\u00f4le du wrapper";
    t[11982] = "If your TCP port is firewalled with inbound TCP enabled, routers will not be able to contact you via TCP, which will hurt the network.";
    t[11983] = "Si votre port TCP est derri\u00e8re un pare-feu et que le TCP entrant est activ\u00e9, les routeurs ne pourront pas vous contacter par le TCP, ce qui nuira au r\u00e9seau.";
    t[11984] = "Local Identity";
    t[11985] = "Identit\u00e9 locale";
    t[11994] = "While I2P will work fine behind most firewalls, your speeds and network integration will generally improve if the I2P port is forwarded for both UDP and TCP.";
    t[11995] = "Bien que I2P fonctionne bien derri\u00e8re la plupart des pare-feu, vos vitesse et int\u00e9gration au r\u00e9seau seront g\u00e9n\u00e9ralement am\u00e9lior\u00e9es si le port d\u2019I2P est r\u00e9achemin\u00e9 pour l\u2019UDP et le TCP.";
