    t[12020] = "Tunnels longer than 3 hops (for example 2 hops + 0-2 hops, 3 hops + 0-1 hops, 3 hops + 0-2 hops), or a high quantity + backup quantity, may severely reduce performance or reliability.";
    t[12021] = "Des tunnels de plus de 3 sauts (p. ex. 2 sauts + 0 \u00e0 2 sauts, 3 sauts + 0 \u00e0 1 saut, 3 sauts + 0 \u00e0 2 sauts) ou une quantit\u00e9 + une quantit\u00e9 de secours \u00e9lev\u00e9es, peuvent gravement d\u00e9grader les performances ou la fiabilit\u00e9.";
