    t[12023] = "Barre lat\u00e9rale";
    t[12024] = "A router that facilitates the connection to the network of another router that is behind a firewall.";
    t[12025] = "Un routeur qui facilite la connexion au r\u00e9seau d\u2019un autre routeur situ\u00e9 derri\u00e8re un pare-feu.";
    t[12026] = "I2P FAQ";
    t[12027] = "FAQ d\u2019I2P";
    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "En survolant le titre <i>Informations routeur</i>, votre identit\u00e9 de routeur tronqu\u00e9e sera affich\u00e9e (les 4 premiers caract\u00e8res (24 bits) du hachage de routeur Base64 de 44 caract\u00e8res (256 bits)). Le hachage complet est affich\u00e9 dans votre <a href='netdb?r=.'>entr\u00e9e de base de donn\u00e9es r\u00e9seau</a>. Ne r\u00e9v\u00e9lez jamais ceci \u00e0 quiconque, car votre identit\u00e9 de routeur est li\u00e9e de fa\u00e7on unique \u00e0 votre adresse IP dans la base de donn\u00e9es r\u00e9seau.";
    t[12030] = "Previous";
    t[12031] = "Pr\u00e9c\u00e9dent";
    t[12032] = "Stopped router";
    t[12033] = "Le routeur a \u00e9t\u00e9 arr\u00eat\u00e9";
    t[12038] = "Directory listings (sometimes referred to as virtual directories) are enabled by default, so you can host files from a sub-directory of <code>docroot</code> without providing a page with links to the files. You can also serve content that exists outside of <code>docroot</code> by using a <a href=https://en.wikipedia.org/wiki/Symbolic_link target=_blank rel=noreferrer class='sitelink external'>symbolic link</a> to the desired directory.";
    t[12039] = "Les listes de r\u00e9pertoires (parfois appel\u00e9s r\u00e9pertoires virtuels) sont activ\u00e9es par d\u00e9faut, de sorte que vous pouvez h\u00e9berger des fichiers \u00e0 partir d'un sous-r\u00e9pertoire de <code>docroot</code> sans fournir une page avec des liens vers les fichiers. Vous pouvez \u00e9galement servir du contenu existant en dehors de <code>docroot</code> en utilisant un <a href=https://fr.wikipedia.org/wiki/Lien_symbolique target=_blank rel=noreferrer class='sitelink external'>lien symbolique</a> vers le r\u00e9pertoire souhait\u00e9.";
    t[12044] = "You have configured I2P to share only {0} KBps.";
