    t[12062] = "Using the <i class=example>explicit</i> directive, a threshold can be applied to a remote destination listed in the definition itself, with the option to specify custom thresholds for multiple destinations. Remote destinations can also be excluded from the default threshold using the <i class=example>allow</i> keyword, or permanently blocked using the <i class=example>deny</i> keyword:";
    t[12063] = "\u00c0 l'aide de la directive <i class=example>explicit</i>, un seuil peut \u00eatre appliqu\u00e9 \u00e0 une destination distante list\u00e9e dans la d\u00e9finition elle-m\u00eame, avec l'option de sp\u00e9cifier des seuils personnalis\u00e9s pour plusieurs destinations. Les destinations distantes peuvent \u00e9galement \u00eatre exclues du seuil par d\u00e9faut \u00e0 l'aide du mot-cl\u00e9 <i class=example>allow</i>, ou bloqu\u00e9es de mani\u00e8re permanente en utilisant le mot-cl\u00e9 <i class=example>deny</i>:";
