    t[12184] = "This setting determines the number of NetDb DHT buckets the Peer Exploration Job will reference when run. By default, the number of buckets to explore will vary depending on whether the router has been running for over an hour, if the router is hidden or in the 'K' bandwidth tier, and the number of known routers.";
    t[12185] = "Ce param\u00e8tre d\u00e9termine le nombre de seaux DHT NetDb auquel se r\u00e9f\u00e9rera la t\u00e2che d'Exploration de pairs lors de son ex\u00e9cution. Par d\u00e9faut, le nombre de seaux \u00e0 explorer variera en fonction de la dur\u00e9e d'ex\u00e9cution du routeur (plus d'une heure ou non), si le routeur est en mode cach\u00e9 ou dans la cat\u00e9gorie de bande passante 'K', et du nombre de routeurs connus.";
    t[12186] = "threat points";
