    t[12198] = "Hostname Registration";
    t[12199] = "Enregistrement du nom d'h\u00f4te";
    t[12200] = "If the number of known peers drops below 50, I2P will attempt to reseed automatically. If the reseed attempt fails, a notification will appear in the sidebar with an option to manually reseed. A failed reseed attempt can occur if your local firewall limits outbound traffic, you are experiencing network connectivity issues, or if the reseed request is blocked entirely.";
    t[12201] = "Si le nombre de pairs connus passe sous les 50, I2P tentera de se r\u00e9ensemencer automatiquement. Si la tentative de r\u00e9ensemencement \u00e9choue, une notification appara\u00eetra dans la barre lat\u00e9rale avec une option pour le r\u00e9ensemencer manuellement. Une tentative de r\u00e9ensemencement infructueuse peut se produire si votre pare-feu local limite le trafic sortant, si vous avez des probl\u00e8mes de connectivit\u00e9 r\u00e9seau ou si la demande de r\u00e9ensemencement est totalement bloqu\u00e9e.";
    t[12202] = "Alternative privacy-focused front-end for Reddit";
    t[12203] = "Front-end alternatif ax\u00e9 sur la confidentialit\u00e9 pour Reddit";
    t[12224] = "Toggle Tunnels";
    t[12225] = "Activer/D\u00e9sactiver les tunnels";
    t[12228] = "Can be disabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces in the <code>jetty.xml</code> file.";
    t[12229] = "Peut \u00eatre d\u00e9sactiv\u00e9 dans le fichier <code>clients.config</code>. Peut \u00e9galement \u00eatre configur\u00e9 pour se lier \u00e0 une interface sp\u00e9cifique ou \u00e0 toutes les interfaces dans le fichier <code>jetty.xml</code>.";
    t[12230] = "You can determine which services automatically start when the router starts, manage tunnel allocation to optimize for high usage services or to minimize the the cpu and memory overhead, add server and client tunnels to host or access services on the network, set rate limiting or tunnel filtering for your server tunnels and more.";
    t[12231] = "Vous pouvez d\u00e9terminer quels services d\u00e9marrent automatiquement lors du lancement du routeur, g\u00e9rer l'allocation des tunnels pour optimiser les services \u00e0 forte utilisation ou minimiser les surco\u00fbts CPU et m\u00e9moire, ajouter des tunnels serveur et client pour h\u00e9berger ou acc\u00e9der \u00e0 des services sur le r\u00e9seau, d\u00e9finir des limitations de d\u00e9bit ou des filtres de tunnel pour vos tunnels serveur et plus encore.";
    t[12232] = "Binds to the LAN address. Can be changed with advanced config <code>i2np.upnp.HTTPPort=nnnn</code>. Can be disabled on the <a href=/confignet>Network Configuration page</a>.";
    t[12233] = "Se lie \u00e0 l'adresse LAN. Peut \u00eatre modifi\u00e9 avec la configuration avanc\u00e9e <code>i2np.upnp.HTTPPort=nnnn</code>. Peut \u00eatre d\u00e9sactiv\u00e9 sur la page <a href=/confignet>Configuration r\u00e9seau</a>.";
    t[12234] = "Data transferred";
    t[12235] = "Donn\u00e9es transf\u00e9r\u00e9es";
    t[12244] = "In the box marked <i>No Proxy for</i> add the line <code>127.0.0.1,localhost</code> to ensure the I2P console and other locally hosted websites are still available.";
    t[12245] = "Dans la case marqu\u00e9e <i>Aucun proxy pour</i>, ajoutez la ligne <code>127.0.0.1,localhost</code> pour garantir que la console I2P et les autres sites Web h\u00e9berg\u00e9s localement sont toujours disponibles.";
